INSERT INTO `mqs_quotes` (`id`, `user_id`, `quote`, `color_code`, `created_datetime`, `created_ip`, `modified_datetime`, `modified_ip`) VALUES
(8,	4,	'I fall in love every time. And I don’t really fall in love a lot, but when I do, I fall hard.',	'#CDEDF6',	'2020-12-24 06:40:22',	'103.118.34.29',	'2020-12-27 18:32:35',	'103.118.34.29'),
(9,	4,	'My fans are the best. I mean if there was a war, I think they’d definitely win just because they’d kill them with kindness.',	'#CA7747',	'2020-12-24 06:42:12',	'103.118.34.29',	'2020-12-27 18:32:49',	'103.118.34.29'),
(10,	4,	'Maybe you’re a reason why all the doors are closed, so you can open one that leads you to the perfect road.',	'#2FA220',	'2020-12-24 06:42:35',	'103.118.34.29',	'2020-12-27 18:33:07',	'103.118.34.29'),
(11,	4,	'I think you can have it all, you just have to work really hard because great things don’t come easily',	'#081c15',	'2020-12-24 06:45:29',	'103.118.34.29',	'2020-12-27 18:33:28',	'103.118.34.29'),
(12,	4,	'What I wanted to be and who I am is a singer and a songwriter. I wanted to be onstage, and I wanted the world to hear my music. The product of that is fame and the disgusting celebrity that goes along with it. But celebrity does not equal creativity.',	'#603043',	'2020-12-24 06:45:50',	'103.118.34.29',	'2020-12-27 18:33:57',	'103.118.34.29'),
(13,	4,	'I have the multipersonality disorder – in a very good way, of course – when it comes to my fashion choices.',	'#F4BBFF',	'2020-12-24 06:46:12',	'103.118.34.29',	'2020-12-27 18:34:07',	'103.118.34.29'),
(14,	4,	'You said move on, where do I go?',	'#E5D6BE',	'2020-12-24 06:46:28',	'103.118.34.29',	'2020-12-27 18:34:16',	'103.118.34.29'),
(15,	4,	'I just like having fun. And, you know, sometimes I just like to present myself in that fun energy.',	'#0E203D',	'2020-12-24 06:46:44',	'103.118.34.29',	'2020-12-27 18:35:40',	'103.118.34.29'),
(16,	4,	'I have confidence because my research shows that I should just really trust my instincts.',	'#bc4749',	'2020-12-24 06:47:01',	'103.118.34.29',	'2020-12-27 18:35:33',	'103.118.34.29'),
(17,	4,	'You know you’re living right when you wake up, brush your hair – and confetti falls out!',	'#734F96',	'2020-12-24 06:50:32',	'103.118.34.29',	'2020-12-27 18:35:25',	'103.118.34.29'),
(18,	4,	'If you can believe in something great, then you can achieve something great.',	'#72efdd',	'2020-12-24 06:50:50',	'103.118.34.29',	'2020-12-27 18:35:16',	'103.118.34.29'),
(19,	4,	'My job is for the people. It’s for the public. It’s for their consumption. So I’ve done a lot in that way, and I see that the hard work has finally paid off.',	'#5EB1BF',	'2020-12-24 06:51:06',	'103.118.34.29',	'2020-12-27 18:35:05',	'103.118.34.29'),
(20,	4,	'I wasn’t allowed to listen to a lot of music growing up. It wasn’t until I started to make my gospel record when I was around 14 or 15 that I started to be exposed to more outside influences.',	'#02c39a',	'2020-12-24 06:51:36',	'103.118.34.29',	'2020-12-27 18:34:56',	'103.118.34.29'),
(21,	4,	'A lot of the time people don’t even know what they want until they see something new.',	'#E32475',	'2020-12-24 06:51:53',	'103.118.34.29',	'2020-12-27 18:34:48',	'103.118.34.29'),
(22,	4,	'I was being musically mentored by a lot of people who were obviously more talented and skilled than I was, and I thought that I would just kind of learn the ropes of songwriting there – like how to do acoustic, country-esque songs, which I like because there’s so much story in them.',	'#80ABE9',	'2020-12-24 06:52:14',	'103.118.34.29',	'2020-12-27 18:36:08',	'103.118.34.29'),
(23,	4,	'I am not a feminist, but I do believe in the strength of women.',	'#800080',	'2020-12-24 06:52:29',	'103.118.34.29',	'2020-12-24 06:52:29',	'103.118.34.29'),
(24,	5,	'I always wrote poetry and stuff like that, so putting songs together wasn\'t that spectacular.',	'#F8A1AE',	'2020-12-24 07:01:03',	'103.118.34.29',	'2020-12-26 20:41:29',	'103.118.34.29'),
(25,	5,	'I don\'t ever wanna drink again, I just, ooh I just need a friend.',	'#F1A7FE',	'2020-12-24 07:03:13',	'103.118.34.29',	'2020-12-26 20:42:22',	'103.118.34.29'),
(26,	5,	'If I died tomorrow, I would be a happy girl.',	'#04A5AA',	'2020-12-24 07:12:29',	'103.118.34.29',	'2020-12-24 07:14:28',	'103.118.34.29'),
(27,	5,	'I don\'t have emotional needs, only physical ones.',	'#80ABE9',	'2020-12-24 07:14:18',	'103.118.34.29',	'2020-12-24 07:14:18',	'103.118.34.29'),
(28,	5,	'And as a writer, your self-worth is literally based on the last thing you wrote.',	'#F1BEBA',	'2020-12-24 07:15:13',	'103.118.34.29',	'2020-12-24 07:15:13',	'103.118.34.29'),
(29,	5,	'I don’t need help because if I can’t help myself I can’t be helped.',	'#F8A1AE',	'2020-12-24 07:17:11',	'103.118.34.29',	'2020-12-24 07:17:11',	'103.118.34.29'),
(30,	5,	'I was hit by a car once on my bike, but I still rode home.',	'#F4879F',	'2020-12-24 07:17:29',	'103.118.34.29',	'2020-12-24 07:17:29',	'103.118.34.29'),
(31,	5,	'I write songs about stuff that I can\'t really get past personally - and then I write a song about it and I feel better.',	'#E74D91',	'2020-12-24 07:17:50',	'103.118.34.29',	'2020-12-24 07:17:50',	'103.118.34.29'),
(32,	5,	'If you\'re nice to me I\'ll never write anything bad about you.',	'#80ABE9',	'2020-12-24 07:18:20',	'103.118.34.29',	'2020-12-24 07:18:20',	'103.118.34.29'),
(33,	5,	'Life\'s short. Anything could happen, and it usually does, so there is no point in sitting around thinking about all the ifs, ands and buts.',	'#F1BEBA',	'2020-12-24 07:18:42',	'103.118.34.29',	'2020-12-24 07:18:42',	'103.118.34.29'),
(34,	5,	'I like pin-up girls. I\'m more of a boy than a girl. I\'m not a lesbian, though - not before a sambuca anyway.',	'#F8A1AE',	'2020-12-24 07:19:05',	'103.118.34.29',	'2020-12-24 07:19:05',	'103.118.34.29'),
(35,	5,	'The jazz I love is sweet and pure with raw elements, which is exactly what the good hip-hop is doing now.',	'#F4879F',	'2020-12-24 07:19:29',	'103.118.34.29',	'2020-12-24 07:19:29',	'103.118.34.29'),
(36,	5,	'Music is the only thing that will give and give and give and not take...',	'#E74D91',	'2020-12-24 07:19:59',	'103.118.34.29',	'2020-12-24 07:19:59',	'103.118.34.29'),
(37,	5,	'I read a lot when I\'m travelling and always have a couple of books on the go.',	'#F3E7DB',	'2020-12-24 07:21:25',	'103.118.34.29',	'2020-12-24 07:21:25',	'103.118.34.29'),
(38,	5,	'I don\'t think your ability to fight has anything to do with how big you are. It\'s to do with how much anger is in you.',	'#F8A1AE',	'2020-12-24 07:21:41',	'103.118.34.29',	'2020-12-24 07:21:41',	'103.118.34.29'),
(39,	7,	'I’ve never wanted to look like models on the cover of magazines. I represent the majority of women and I’m very proud of that.',	'#9889F6',	'2020-12-24 07:49:59',	'103.118.34.29',	'2020-12-24 07:49:59',	'103.118.34.29'),
(40,	7,	'Regrets and Mistakes, they’re Memories made.',	'#EDDB36',	'2020-12-24 07:50:25',	'103.118.34.29',	'2020-12-24 07:50:25',	'103.118.34.29'),
(41,	7,	'I don’t really need to stand out, there’s room for everyone. Although I haven’t built a niche yet, I’m just writing love songs.',	'#F263CF',	'2020-12-24 07:50:42',	'103.118.34.29',	'2020-12-24 07:50:42',	'103.118.34.29'),
(42,	7,	'You have to prioritize what you stress about when you have a child.',	'#E32475',	'2020-12-24 07:51:00',	'103.118.34.29',	'2020-12-24 07:51:00',	'103.118.34.29'),
(43,	7,	'I don’t make music for eyes. I make music for ears.',	'#E32475',	'2020-12-24 07:51:24',	'103.118.34.29',	'2020-12-24 07:51:24',	'103.118.34.29'),
(44,	7,	'I’ve always written down how I feel.',	'#D1D5F2',	'2020-12-24 07:52:01',	'103.118.34.29',	'2020-12-24 07:52:01',	'103.118.34.29'),
(45,	7,	'I won’t let you close enough to hurt me.',	'#F1A7FE',	'2020-12-24 07:52:27',	'103.118.34.29',	'2020-12-24 07:52:27',	'103.118.34.29'),
(46,	7,	'Heartbreak can definitely give you a deeper sensibility for writing songs. I drew on a lot of heartbreak when I was writing my first album, I didn’t mean to but I just did.',	'#F4BBFF',	'2020-12-24 07:53:17',	'103.118.34.29',	'2020-12-24 07:53:17',	'103.118.34.29'),
(47,	7,	'I am never writing a breakup record again, by the way. I’m done with being a bitter witch.',	'#5EB1BF',	'2020-12-24 08:01:01',	'103.118.34.29',	'2020-12-24 08:01:01',	'103.118.34.29'),
(48,	7,	'Whenever I’m about to eat meat I always see my little dog’s eyes.',	'#EF7B45',	'2020-12-24 08:01:20',	'103.118.34.29',	'2020-12-24 08:01:20',	'103.118.34.29'),
(49,	7,	'People are starting to go on about my weight but I’m not going to change my size because they don’t like the way I look.',	'#D84727',	'2020-12-24 08:01:44',	'103.118.34.29',	'2020-12-24 08:01:44',	'103.118.34.29'),
(50,	7,	'I don’t want to be in everyone’s face. I’m a big music fan, and I get really pissed off when it gets like that and I don’t want people to get like that with me.',	'#734F96',	'2020-12-24 08:02:10',	'103.118.34.29',	'2020-12-24 08:02:10',	'103.118.34.29'),
(51,	7,	'Be brave and fearless to know that even if you do make a wrong decision, you’re making it for a good reason.',	'#4047F9',	'2020-12-24 08:12:44',	'103.118.34.29',	'2020-12-24 08:12:44',	'103.118.34.29'),
(52,	7,	'My worst fear is my music won’t connect with the public.',	'#FFCA0A',	'2020-12-24 08:13:02',	'103.118.34.29',	'2020-12-24 08:13:02',	'103.118.34.29'),
(53,	7,	'Nothing that I wouldn’t do, to make you feel my love.',	'#2FA220',	'2020-12-24 08:13:28',	'103.118.34.29',	'2020-12-24 08:13:28',	'103.118.34.29'),
(54,	9,	'Women absolutely deserve respect.',	'#F1BEBA',	'2020-12-24 08:45:08',	'103.118.34.29',	'2020-12-24 08:45:08',	'103.118.34.29'),
(55,	9,	'It’s very satisfying. To perform the way you want to. And the way you know that you can.',	'#FFCA0A',	'2020-12-24 08:45:31',	'103.118.34.29',	'2020-12-24 08:45:31',	'103.118.34.29'),
(56,	9,	'It really is an honor if I can be inspirational to a younger singer or person. It means I’ve done my job.',	'#CDA9A0',	'2020-12-24 08:46:01',	'103.118.34.29',	'2020-12-24 08:46:01',	'103.118.34.29'),
(57,	9,	'Sometimes, what you’re looking for is already there.',	'#F1A7FE',	'2020-12-24 08:52:12',	'103.118.34.29',	'2020-12-24 08:52:12',	'103.118.34.29'),
(58,	9,	'People really don’t have to give you anything, so appreciate what people give you.',	'#1E8896',	'2020-12-24 08:52:35',	'103.118.34.29',	'2020-12-24 08:52:35',	'103.118.34.29'),
(59,	9,	'We all require and want respect, man or woman, black or white. It’s our basic human right.',	'#FFCA0A',	'2020-12-24 08:52:53',	'103.118.34.29',	'2020-12-24 08:52:53',	'103.118.34.29'),
(60,	9,	'Music changes, and I’m gonna change right along with it.',	'#1E457C',	'2020-12-24 08:53:23',	'103.118.34.29',	'2020-12-24 08:53:23',	'103.118.34.29'),
(61,	9,	'If you disrespect everybody that you run into, how in the world do you think everybody’s supposed to respect you?',	'#CA7747',	'2020-12-24 08:53:43',	'103.118.34.29',	'2020-12-24 08:53:43',	'103.118.34.29'),
(62,	9,	'Being a singer is a natural gift. It means I’m using to the highest degree possible the gift that God gave me to use. I’m happy with that',	'#F8A1AE',	'2020-12-24 08:54:02',	'103.118.34.29',	'2020-12-24 08:54:02',	'103.118.34.29'),
(63,	9,	'Trying to grow up is hurting. You make mistakes. You try to learn from them, and when you don’t, it hurts even more.',	'#EDDB36',	'2020-12-24 08:54:35',	'103.118.34.29',	'2020-12-24 08:54:35',	'103.118.34.29'),
(64,	9,	'Be your own artist, and always be confident in what you’re doing. If you’re not going to be confident, you might as well not be doing it.',	'#603043',	'2020-12-24 08:54:54',	'103.118.34.29',	'2020-12-24 08:54:54',	'103.118.34.29'),
(65,	9,	'When God loves you, what can be better than that?',	'#F4BBFF',	'2020-12-24 08:55:12',	'103.118.34.29',	'2020-12-24 08:55:12',	'103.118.34.29'),
(66,	9,	'Who hasn’t had a weight issue? If not the body, certainly the big head!',	'#D84727',	'2020-12-24 08:55:28',	'103.118.34.29',	'2020-12-24 08:55:28',	'103.118.34.29'),
(67,	9,	'Soul is a constant. It’s cultural. It’s always going to be there, in different flavors and degrees.',	'#E5D6BE',	'2020-12-24 08:55:44',	'103.118.34.29',	'2020-12-24 08:55:44',	'103.118.34.29'),
(68,	10,	'I don’t regret any of the life decisions I’ve made in my life because with every choice I’ve made I’ve learned something new.',	'#F8A1AE',	'2020-12-24 09:03:04',	'103.118.34.29',	'2020-12-24 09:03:04',	'103.118.34.29'),
(69,	10,	'Everyone strives for approval and wants to be loved.',	'#C74D0C',	'2020-12-24 09:03:23',	'103.118.34.29',	'2020-12-24 09:03:23',	'103.118.34.29'),
(70,	10,	'You don’t have to have much to show how much you care.',	'#005695',	'2020-12-24 09:03:44',	'103.118.34.29',	'2020-12-24 09:03:44',	'103.118.34.29'),
(71,	10,	'Don’t ever doubt yourselves or waste a second of your life. It’s too short, and you’re too special.',	'#E32475',	'2020-12-24 09:04:04',	'103.118.34.29',	'2020-12-24 09:04:04',	'103.118.34.29'),
(72,	10,	'Learn from your mistakes. Take responsibility and forgive yourself ',	'#B57EDC',	'2020-12-24 09:04:53',	'103.118.34.29',	'2020-12-24 09:04:53',	'103.118.34.29'),
(73,	10,	'Block out all negative energy, and just love.',	'#197687',	'2020-12-24 09:05:13',	'103.118.34.29',	'2020-12-24 09:05:13',	'103.118.34.29'),
(74,	10,	'I’m willing to take the brunt for fighting in what I believe in.',	'#5EB1BF',	'2020-12-24 09:05:33',	'103.118.34.29',	'2020-12-24 09:05:33',	'103.118.34.29'),
(75,	10,	'Be happy being you.',	'#D1D5F2',	'2020-12-24 09:05:52',	'103.118.34.29',	'2020-12-24 09:05:52',	'103.118.34.29'),
(76,	10,	'Know that you are just as perfect as anyone else, exactly as you are.',	'#734F96',	'2020-12-24 09:06:17',	'103.118.34.29',	'2020-12-24 09:06:17',	'103.118.34.29'),
(77,	10,	'Never take yourself too seriously.',	'#E74D91',	'2020-12-24 09:06:37',	'103.118.34.29',	'2020-12-24 09:06:37',	'103.118.34.29'),
(78,	10,	'It’s ok to be different.',	'#877B76',	'2020-12-24 09:06:54',	'103.118.34.29',	'2020-12-24 09:06:54',	'103.118.34.29'),
(79,	10,	'If we give a little love, maybe we can change the world.',	'#0E203D',	'2020-12-24 09:07:15',	'103.118.34.29',	'2020-12-24 09:07:15',	'103.118.34.29'),
(80,	10,	'Everyone is beautiful, everyone is perfect and everyone is lovely.',	'#80ABE9',	'2020-12-24 09:07:33',	'103.118.34.29',	'2020-12-24 09:07:33',	'103.118.34.29'),
(81,	10,	'Only be with somebody if they make you feel like the best version of yourself. You can’t sacrifice yourself for anybody, you know?',	'#B0A49B',	'2020-12-24 09:07:54',	'103.118.34.29',	'2020-12-24 09:07:54',	'103.118.34.29'),
(82,	10,	'Don’t take everything so seriously. And just be happier.',	'#4047F9',	'2020-12-24 09:08:15',	'103.118.34.29',	'2020-12-24 09:08:15',	'103.118.34.29'),
(83,	10,	'I think it’s so important for girls to love themselves and to treat their bodies respectfully.',	'#9889F6',	'2020-12-24 09:08:40',	'103.118.34.29',	'2020-12-24 09:08:40',	'103.118.34.29'),
(84,	11,	'Take all the rules away. How can we live if we don’t change?',	'#5EB1BF',	'2020-12-24 09:26:13',	'103.118.34.29',	'2020-12-24 09:26:13',	'103.118.34.29'),
(85,	11,	'Your self-worth is determined by you. You don’t have to depend on someone telling you who you are.',	'#F1BEBA',	'2020-12-24 09:26:32',	'103.118.34.29',	'2020-12-24 09:26:32',	'103.118.34.29'),
(86,	11,	'Everyone’s not good at everything, it’s OK to depend on someone.',	'#CDA9A0',	'2020-12-24 09:26:50',	'103.118.34.29',	'2020-12-24 09:26:50',	'103.118.34.29'),
(87,	11,	'If everything was perfect, you would never learn and you would never grow.',	'#F263CF',	'2020-12-24 09:27:23',	'103.118.34.29',	'2020-12-24 09:27:23',	'103.118.34.29'),
(88,	11,	'I felt like it was time to set up my future, so I set a goal. My goal was independence.',	'#F1A7FE',	'2020-12-24 09:27:41',	'103.118.34.29',	'2020-12-24 09:27:41',	'103.118.34.29'),
(89,	11,	'Do what you were born to do. You have to trust yourself.',	'#1E8896',	'2020-12-24 09:27:58',	'103.118.34.29',	'2020-12-24 09:27:58',	'103.118.34.29'),
(90,	11,	'Your self-worth is determined by you. You don’t have to depend on someone telling you who you are.',	'#FFCA0A',	'2020-12-24 09:28:20',	'103.118.34.29',	'2020-12-24 09:28:20',	'103.118.34.29'),
(91,	11,	'Power’s not given to you. You have to take it.',	'#CDEDF6',	'2020-12-24 09:31:29',	'103.118.34.29',	'2020-12-24 09:31:29',	'103.118.34.29'),
(92,	11,	'I know I’m stronger in the songs than I really am. Sometimes I need to hear it myself. We all need to hear those empowering songs to remind us.',	'#1E457C',	'2020-12-24 09:32:02',	'103.118.34.29',	'2020-12-24 09:32:02',	'103.118.34.29'),
(93,	11,	'When I’m not feeling my best I ask myself, ‘What are you gonna do about it?’ I use the negativity to fuel the transformation into a better me.',	'#CA7747',	'2020-12-24 09:32:21',	'103.118.34.29',	'2020-12-24 09:32:21',	'103.118.34.29'),
(94,	11,	'The reality is: sometimes you lose. And you’re never too good to lose. You’re never too big to lose. You’re never too smart to lose. It happens.',	'#F8A1AE',	'2020-12-24 09:32:42',	'103.118.34.29',	'2020-12-24 09:32:42',	'103.118.34.29'),
(95,	11,	'We need to reshape our own perception of how we view ourselves. We have to step up as women and take the lead.',	'#EDDB36',	'2020-12-24 09:33:09',	'103.118.34.29',	'2020-12-24 09:33:09',	'103.118.34.29'),
(96,	11,	'The most alluring thing a woman can have is confidence.',	'#603043',	'2020-12-24 09:46:12',	'103.118.34.29',	'2020-12-24 09:46:12',	'103.118.34.29'),
(97,	11,	'I don’t like to gamble, but if there’s one thing I’m willing to bet on, it’s myself.',	'#F4BBFF',	'2020-12-24 09:46:33',	'103.118.34.29',	'2020-12-24 09:46:33',	'103.118.34.29'),
(98,	11,	'It’s easy to hear the voices of others and often very difficult to hear your own. Every person you meet is going to want something different from you. The question is: what do you want for yourself?',	'#D84727',	'2020-12-24 09:46:47',	'103.118.34.29',	'2020-12-25 08:13:05',	'103.155.2.125'),
(105,	15,	'Dare to wear the foolish clown face.',	'#E5D6BE',	'2020-12-26 12:29:09',	'103.118.34.29',	'2020-12-26 12:29:09',	'103.118.34.29'),
(106,	15,	'I think my greatest ambition in life is to pass on to others what I know.',	'#F8A1AE',	'2020-12-26 12:29:27',	'103.118.34.29',	'2020-12-26 12:29:27',	'103.118.34.29'),
(107,	15,	'What I do with my life is of my own doing. I live it the best way I can.',	'#005695',	'2020-12-26 12:30:04',	'103.118.34.29',	'2020-12-26 12:30:04',	'103.118.34.29'),
(108,	15,	'The best revenge is massive success.',	'#E32475',	'2020-12-26 12:30:24',	'103.118.34.29',	'2020-12-26 12:30:24',	'103.118.34.29'),
(109,	15,	'Whatever else has been said about me personally is unimportant. When I sing, I believe. I’m honest.',	'#B57EDC',	'2020-12-26 12:30:41',	'103.118.34.29',	'2020-12-26 12:30:41',	'103.118.34.29'),
(110,	15,	'The martial music of every sideburned delinquent on the face of the earth.',	'#197687',	'2020-12-26 12:30:59',	'103.118.34.29',	'2020-12-26 12:30:59',	'103.118.34.29'),
(111,	15,	'It took me a long, long time to learn what I now know, and I don’t want that to die with me.',	'#5EB1BF',	'2020-12-26 12:31:23',	'103.118.34.29',	'2020-12-26 12:31:23',	'103.118.34.29'),
(112,	15,	'The cigarettes you light one after another won’t help you forget her.',	'#F4879F',	'2020-12-26 12:31:43',	'103.118.34.29',	'2020-12-26 12:31:43',	'103.118.34.29'),
(113,	15,	'The big lesson in life, baby, is never be scared of anyone or anything.',	'#734F96',	'2020-12-26 12:32:10',	'103.118.34.29',	'2020-12-26 12:32:10',	'103.118.34.29'),
(114,	15,	'People often remark that I’m pretty lucky. Luck is only important in so far as getting the chance to sell yourself at the right moment. After that, you’ve got to have talent and know how to use it.',	'#E74D91',	'2020-12-26 12:32:34',	'103.118.34.29',	'2020-12-26 12:32:34',	'103.118.34.29'),
(115,	15,	'All day long, they lie in the sun, and when the sun goes down, they lie some more.',	'#877B76',	'2020-12-26 12:32:50',	'103.118.34.29',	'2020-12-26 12:32:50',	'103.118.34.29'),
(116,	15,	'If you possess something but you can’t give it away, then you don’t possess it … it possesses you.',	'#0E203D',	'2020-12-26 12:33:07',	'103.118.34.29',	'2020-12-26 12:33:07',	'103.118.34.29'),
(117,	15,	'I’m gonna live till I die.',	'#80ABE9',	'2020-12-26 12:33:27',	'103.118.34.29',	'2020-12-26 12:33:27',	'103.118.34.29'),
(118,	15,	'Take a deep breath, pick yourself up, dust yourself off, and start all over again.',	'#B0A49B',	'2020-12-26 12:33:49',	'103.118.34.29',	'2020-12-26 12:33:49',	'103.118.34.29'),
(119,	15,	'Fear is the enemy of logic.',	'#4047F9',	'2020-12-26 12:34:06',	'103.118.34.29',	'2020-12-26 12:34:06',	'103.118.34.29'),
(120,	15,	'You can be the most artistically perfect performer in the world, but an audience is like a broad–if you’re indifferent, Endsville.',	'#9889F6',	'2020-12-26 12:34:26',	'103.118.34.29',	'2020-12-26 12:34:26',	'103.118.34.29'),
(121,	15,	'You only go around once, but if you play your cards right, once is enough.',	'#5EB1BF',	'2020-12-26 12:34:52',	'103.118.34.29',	'2020-12-26 12:34:52',	'103.118.34.29'),
(122,	16,	'I would like to be called an inspiration to people, not a role model - because I make mistakes like everybody else. When I\'m offstage, I\'m just like everybody else.',	'#F1BEBA',	'2020-12-26 12:38:20',	'103.118.34.29',	'2020-12-26 12:38:20',	'103.118.34.29'),
(123,	16,	'With love, you should go ahead and take the risk of getting hurt... because love is an amazing feeling.',	'#CDA9A0',	'2020-12-26 12:38:37',	'103.118.34.29',	'2020-12-26 12:38:37',	'103.118.34.29'),
(124,	16,	'I\'m so happy to be able to give kids the opportunity to learn about amazing world of dance and music that I\'ve have been lucky enough to make such a big part of my own life.',	'#F263CF',	'2020-12-26 12:38:51',	'103.118.34.29',	'2020-12-26 12:38:51',	'103.118.34.29'),
(125,	16,	'I know not everyone will like me, but this is who I am so if you don\'t like it, tough!',	'#F1A7FE',	'2020-12-26 12:39:07',	'103.118.34.29',	'2020-12-26 12:39:07',	'103.118.34.29'),
(126,	16,	'I don\'t want to go through the pain. My mom said giving birth was the most excruciating thing she\'s ever gone through in her life.',	'#1E8896',	'2020-12-26 12:39:27',	'103.118.34.29',	'2020-12-26 12:39:27',	'103.118.34.29'),
(127,	16,	'I would really, really, really like to be a legend like Madonna. Madonna knows what to do next, and when she\'s performing, the audience is just in awe of her.',	'#FFCA0A',	'2020-12-26 12:40:00',	'103.118.34.29',	'2020-12-26 12:40:00',	'103.118.34.29'),
(128,	16,	'The cool thing about being famous is traveling. I have always wanted to travel across seas, like to Canada and stuff.',	'#081c15',	'2020-12-26 12:43:25',	'103.118.34.29',	'2020-12-26 12:43:25',	'103.118.34.29'),
(129,	16,	'I don\'t understand the whole dating thing. I know right off the bat if I\'m interested in someone, and I don\'t want them to waste their money on me and take me out to eat if I know I\'m not interested in that person.',	'#2FA220',	'2020-12-26 12:44:49',	'103.118.34.29',	'2020-12-26 12:44:49',	'103.118.34.29'),
(130,	16,	'I did not have implants, I just had a growth spurt.',	'#CDEDF6',	'2020-12-26 12:45:25',	'103.118.34.29',	'2020-12-26 12:45:25',	'103.118.34.29'),
(131,	16,	'When you\'re comfortable with someone you love, the silence is the best. And, that\'s how me and J. are. When we\'re in a room together, we don\'t have to say anything. It\'s for real.',	'#1E457C',	'2020-12-26 12:45:52',	'103.118.34.29',	'2020-12-26 12:45:52',	'103.118.34.29'),
(132,	16,	'Justin Timberlake is everything, and what more could you want in a person? He\'s funny. He\'s cute. He\'s great. He just understands. I get him and he gets me, and that\'s cool.',	'#CA7747',	'2020-12-26 12:46:12',	'103.118.34.29',	'2020-12-26 12:46:12',	'103.118.34.29'),
(133,	16,	'Every night, I have to read a book, so that my mind will stop thinking about things that I stress about.',	'#F8A1AE',	'2020-12-26 12:46:31',	'103.118.34.29',	'2020-12-26 12:46:31',	'103.118.34.29'),
(134,	16,	'Onstage I\'m the happiest person in the world.',	'#2FA220',	'2020-12-26 12:46:50',	'103.118.34.29',	'2020-12-26 12:46:50',	'103.118.34.29'),
(135,	16,	'I don\'t really have time to sit down and write. But when I think of a melody, I call up my answering machine and sing it, so I won\'t forget it.',	'#f5cb5c',	'2020-12-26 12:47:08',	'103.118.34.29',	'2020-12-26 12:47:08',	'103.118.34.29'),
(136,	16,	'There\'s no master plan! I\'m just gonna be me and hope it all works out!',	'#081c15',	'2020-12-26 12:47:24',	'103.118.34.29',	'2020-12-26 12:47:24',	'103.118.34.29'),
(137,	17,	'When everything in life gets so complicated it only takes a day to change it.',	'#EDDB36',	'2020-12-26 12:52:13',	'103.118.34.29',	'2020-12-26 12:52:13',	'103.118.34.29'),
(138,	17,	'You have to be who you are, and hopefully they dig it.',	'#603043',	'2020-12-26 12:52:43',	'103.118.34.29',	'2020-12-26 12:52:43',	'103.118.34.29'),
(139,	17,	'You have to envision your life, and then go backwards.',	'#F4BBFF',	'2020-12-26 12:53:03',	'103.118.34.29',	'2020-12-26 12:53:03',	'103.118.34.29'),
(140,	17,	'I think that success is having fun.',	'#D84727',	'2020-12-26 12:53:28',	'103.118.34.29',	'2020-12-26 12:53:28',	'103.118.34.29'),
(141,	17,	'Be in control. Know who you are. And don\'t try to be different just to be different.',	'#E5D6BE',	'2020-12-26 12:53:48',	'103.118.34.29',	'2020-12-26 12:53:48',	'103.118.34.29'),
(142,	17,	'You gotta know what you are, who you are and how you want to be portrayed.',	'#F8A1AE',	'2020-12-26 12:54:04',	'103.118.34.29',	'2020-12-26 12:54:04',	'103.118.34.29'),
(143,	17,	'If you ever forget how much you really mean to me, Every day I will remind you.',	'#C74D0C',	'2020-12-26 12:54:29',	'103.118.34.29',	'2020-12-26 12:54:29',	'103.118.34.29'),
(144,	17,	'I can show you in music better than I can tell you in words.',	'#E32475',	'2020-12-26 12:54:47',	'103.118.34.29',	'2020-12-26 12:54:47',	'103.118.34.29'),
(145,	17,	'I\'ve learned people are watching, so don\'t do nothing stupid.',	'#B57EDC',	'2020-12-26 12:57:30',	'103.118.34.29',	'2020-12-26 12:57:30',	'103.118.34.29'),
(146,	17,	'Music is not math. It\'s science. You keep mixing the stuff up until it blows up on you, or it becomes this incredible potion.',	'#02c39a',	'2020-12-26 12:57:52',	'103.118.34.29',	'2020-12-26 12:57:52',	'103.118.34.29'),
(147,	17,	'Never had much faith in love or miracles, Never wanna put my heart on the line.',	'#197687',	'2020-12-26 12:58:20',	'103.118.34.29',	'2020-12-26 12:58:20',	'103.118.34.29'),
(148,	17,	'I just write songs that I strongly believe in and that are coming from inside. There\'s no tricks. It\'s honesty with big melodies.',	'#5EB1BF',	'2020-12-26 12:58:44',	'103.118.34.29',	'2020-12-26 12:58:44',	'103.118.34.29'),
(149,	17,	'My dream was to not get a day job but to sleep, wake up and do my music. I want to keep that dream forever.',	'#F4879F',	'2020-12-26 12:59:29',	'103.118.34.29',	'2020-12-26 12:59:29',	'103.118.34.29'),
(150,	17,	'You can\'t knock on opportunity\'s door and not be ready.',	'#72efdd',	'2020-12-26 12:59:48',	'103.118.34.29',	'2020-12-26 12:59:48',	'103.118.34.29'),
(151,	18,	'If you follow your dreams, it means you follow your heart. If you do follow your heart, I don\'t think you can go wrong.',	'#734F96',	'2020-12-26 13:12:04',	'103.118.34.29',	'2020-12-26 13:12:04',	'103.118.34.29'),
(152,	18,	'Love doesn\'t ask why, speaks from the heart, and never explains.',	'#E74D91',	'2020-12-26 13:12:21',	'103.118.34.29',	'2020-12-26 13:12:21',	'103.118.34.29'),
(153,	18,	'There\'s been nothing but discipline, discipline, discipline all my life.',	'#bc4749',	'2020-12-26 13:12:38',	'103.118.34.29',	'2020-12-26 13:12:38',	'103.118.34.29'),
(154,	18,	'Love comes to those who believe it, and that\'s the way it is.',	'#877B76',	'2020-12-26 13:12:55',	'103.118.34.29',	'2020-12-26 13:12:55',	'103.118.34.29'),
(155,	18,	'When I do something, I do it all the way. I\'ve been in show business so many years. I\'ve achieved a lot of things.',	'#0E203D',	'2020-12-26 13:17:16',	'103.118.34.29',	'2020-12-26 13:17:16',	'103.118.34.29'),
(156,	18,	'Your heart is pure, your soul is free. Be on your way, don\'t wait for me.',	'#80ABE9',	'2020-12-26 13:21:40',	'103.118.34.29',	'2020-12-26 13:21:40',	'103.118.34.29'),
(157,	18,	'My feet are definitely more grounded than before. And I know that I\'m not holding onto a dream. I\'m holding onto my life.',	'#B0A49B',	'2020-12-26 13:21:59',	'103.118.34.29',	'2020-12-26 13:21:59',	'103.118.34.29'),
(158,	18,	'There\'s no such thing is aging, but maturing and knowledge. It\'s beautiful, I call that beauty.',	'#4047F9',	'2020-12-26 13:22:24',	'103.118.34.29',	'2020-12-26 13:22:24',	'103.118.34.29'),
(159,	18,	'You\'ve been my inspiration, through the lies you were the truth. My world is a better place because of you.',	'#9889F6',	'2020-12-26 13:24:33',	'103.118.34.29',	'2020-12-26 13:24:33',	'103.118.34.29'),
(160,	18,	'Love doesn\'t think twice, it comes all at once, or whispers from a distance.',	'#5EB1BF',	'2020-12-26 13:26:35',	'103.118.34.29',	'2020-12-26 13:26:35',	'103.118.34.29'),
(161,	18,	'Near, far wherever you are...you\'re here in my heart.',	'#00b4d8',	'2020-12-26 13:26:55',	'103.118.34.29',	'2020-12-26 13:26:55',	'103.118.34.29'),
(162,	18,	'There are so many different ways to say \"I love you\" and to talk about love in the songs.',	'#F1BEBA',	'2020-12-26 13:27:12',	'103.118.34.29',	'2020-12-26 13:27:12',	'103.118.34.29'),
(163,	18,	'I don\'t just sing for free. It\'s my work. You\'re paid for what you do. And I work hard.',	'#CDA9A0',	'2020-12-26 13:27:31',	'103.118.34.29',	'2020-12-26 13:27:31',	'103.118.34.29'),
(165,	18,	'Love can touch us one time And last for a life time And never let go till We\'re gone.',	'#F1A7FE',	'2020-12-26 13:28:04',	'103.118.34.29',	'2020-12-26 13:28:04',	'103.118.34.29'),
(166,	18,	'There is no other love like a mother\'s love for her child.',	'#1E8896',	'2020-12-26 13:28:20',	'103.118.34.29',	'2020-12-26 13:28:20',	'103.118.34.29'),
(167,	19,	'People change, things go wrong. Just remember, life goes on.',	'#FFCA0A',	'2020-12-26 19:46:29',	'103.118.34.29',	'2020-12-26 19:46:29',	'103.118.34.29'),
(168,	19,	'Never let a couple of good memories make you move backwards. Look ahead and move on.',	'#CDEDF6',	'2020-12-26 19:46:49',	'103.118.34.29',	'2020-12-26 19:46:49',	'103.118.34.29'),
(169,	19,	'So please don’t judge me and I won’t judge you ’cause it could get ugly before it gets beautiful.',	'#1E457C',	'2020-12-26 19:47:16',	'103.118.34.29',	'2020-12-26 19:47:16',	'103.118.34.29'),
(170,	19,	'Amplify your life, not status. Trust no one. There is always a plot and motive.',	'#CA7747',	'2020-12-26 19:47:31',	'103.118.34.29',	'2020-12-26 19:47:31',	'103.118.34.29'),
(171,	19,	'Rollin round, up and down, up in this bed. I don’t want you to forget.',	'#F8A1AE',	'2020-12-26 19:47:48',	'103.118.34.29',	'2020-12-26 19:47:48',	'103.118.34.29'),
(172,	19,	'I can definitely show you things that’s gonna have you saying I can’t be',	'#2FA220',	'2020-12-26 19:49:13',	'103.118.34.29',	'2020-12-26 19:49:13',	'103.118.34.29'),
(173,	19,	'Even when my world’s falling down, I still wear a smile.',	'#f5cb5c',	'2020-12-26 19:49:29',	'103.118.34.29',	'2020-12-26 19:49:29',	'103.118.34.29'),
(174,	19,	'I always imagined I could be what I wanted to be.',	'#CDEDF6',	'2020-12-26 19:50:10',	'103.118.34.29',	'2020-12-26 19:50:10',	'103.118.34.29'),
(175,	19,	'Jesus didn\'t die on the cross to BLESS our life, He did it to CHANGE our life.',	'#081c15',	'2020-12-26 19:50:32',	'103.118.34.29',	'2020-12-26 19:50:32',	'103.118.34.29'),
(176,	19,	'It’s hard to forget someone who gave you so much to remember.',	'#EDDB36',	'2020-12-26 19:50:49',	'103.118.34.29',	'2020-12-26 19:50:49',	'103.118.34.29'),
(177,	19,	'I want to meet someone who doesn’t already think they know me.',	'#603043',	'2020-12-26 19:51:06',	'103.118.34.29',	'2020-12-26 19:51:06',	'103.118.34.29'),
(178,	19,	'Haters keep on hating cause somebody’s gotta do it.',	'#F4BBFF',	'2020-12-26 19:51:20',	'103.118.34.29',	'2020-12-26 19:51:20',	'103.118.34.29'),
(179,	19,	'You can\'t be old and wise, if you were never young and crazy.',	'#D84727',	'2020-12-26 19:51:38',	'103.118.34.29',	'2020-12-26 19:51:38',	'103.118.34.29'),
(180,	19,	'Everywhere that I’ve been, the only thing I see is beautiful people.',	'#E5D6BE',	'2020-12-26 19:52:15',	'103.118.34.29',	'2020-12-26 19:52:15',	'103.118.34.29'),
(181,	19,	'A man\'s attire is only an outward projection of his inward self.',	'#F8A1AE',	'2020-12-26 19:52:34',	'103.118.34.29',	'2020-12-26 19:52:34',	'103.118.34.29'),
(182,	19,	'Gratitude is the key that unlocks wonder.',	'#C74D0C',	'2020-12-26 19:53:04',	'103.118.34.29',	'2020-12-26 19:53:04',	'103.118.34.29'),
(183,	20,	'I really don\'t spend any time on the Internet, so I guess I live a little under a rock in that respect.',	'#005695',	'2020-12-26 20:04:36',	'103.118.34.29',	'2020-12-26 20:04:36',	'103.118.34.29'),
(184,	20,	'When I learned how millions of children go to bed hungry, my only response was, \'What can I do to help?\'',	'#E32475',	'2020-12-26 20:04:53',	'103.118.34.29',	'2020-12-26 20:04:53',	'103.118.34.29'),
(185,	20,	'You are beautiful in every single way. Words can\'t bring you down.',	'#B57EDC',	'2020-12-26 20:05:10',	'103.118.34.29',	'2020-12-26 20:05:10',	'103.118.34.29'),
(186,	20,	'Everybody needs that one person that takes you to the right place to see all the positives in your life.',	'#02c39a',	'2020-12-26 20:05:28',	'103.118.34.29',	'2020-12-26 20:05:28',	'103.118.34.29'),
(187,	20,	'The roughest road often leads to the top.',	'#5EB1BF',	'2020-12-26 20:05:46',	'103.118.34.29',	'2020-12-26 20:05:46',	'103.118.34.29'),
(188,	20,	'I knew there would be a negative reaction in the press to my divorce, but I am not going to live my life because of something someone might say.',	'#F4879F',	'2020-12-26 20:06:05',	'103.118.34.29',	'2020-12-26 20:06:05',	'103.118.34.29'),
(189,	20,	'I\'m an ocean, because I\'m really deep. If you search deep enough you can find rare exotic treasures.',	'#72efdd',	'2020-12-26 20:20:06',	'103.118.34.29',	'2020-12-26 20:20:06',	'103.118.34.29'),
(190,	20,	'I\'m experimental by nature... always exploring my creativity.',	'#D1D5F2',	'2020-12-26 20:20:36',	'103.118.34.29',	'2020-12-26 20:20:36',	'103.118.34.29'),
(191,	20,	'The female body is something that\'s so beautiful. I wish women would be proud of their bodies and not diss other women for being proud of theirs.',	'#734F96',	'2020-12-26 20:21:27',	'103.118.34.29',	'2020-12-26 20:21:27',	'103.118.34.29'),
(192,	20,	'My emotions overload because there is no hand to hold, there’s no shoulder here to lean on; I’m walking all on my own.',	'#E74D91',	'2020-12-26 20:21:42',	'103.118.34.29',	'2020-12-26 20:21:42',	'103.118.34.29'),
(193,	20,	'I\'m an ocean, because I\'m really deep. If you search deep enough you can find rare exotic treasures.',	'#bc4749',	'2020-12-26 20:22:03',	'103.118.34.29',	'2020-12-26 20:22:03',	'103.118.34.29'),
(194,	20,	'I have always been one to encourage perseverance.',	'#877B76',	'2020-12-26 20:22:25',	'103.118.34.29',	'2020-12-26 20:22:25',	'103.118.34.29'),
(195,	20,	'People expect me to cry, but I always laugh when things go wrong.',	'#0E203D',	'2020-12-26 20:22:48',	'103.118.34.29',	'2020-12-26 20:22:48',	'103.118.34.29'),
(196,	20,	'I\'m a risk taker and I\'ve always been like that, especially when it comes to fashion.',	'#80ABE9',	'2020-12-26 20:23:16',	'103.118.34.29',	'2020-12-26 20:23:16',	'103.118.34.29'),
(197,	21,	'You can neither win nor lose if you don\'t run the race.',	'#B0A49B',	'2020-12-26 20:34:29',	'103.118.34.29',	'2020-12-26 20:34:29',	'103.118.34.29'),
(198,	21,	'There’s a starman waiting in the sky. He’d like to come and meet us, but he thinks he’d blow our minds.',	'#4047F9',	'2020-12-26 20:35:00',	'103.118.34.29',	'2020-12-26 20:35:00',	'103.118.34.29'),
(199,	21,	'The greatest thing you\'ll ever learn is just to love and be loved in return.',	'#9889F6',	'2020-12-26 20:35:14',	'103.118.34.29',	'2020-12-26 20:35:14',	'103.118.34.29'),
(200,	21,	'Once you lose that sense of wonder at being alive, you\'re pretty much on the way out...',	'#5EB1BF',	'2020-12-26 20:35:29',	'103.118.34.29',	'2020-12-26 20:35:29',	'103.118.34.29'),
(201,	21,	'Nobody reads anymore, nobody goes out and looks and explores the society and culture they were brought up in.',	'#00b4d8',	'2020-12-26 20:35:45',	'103.118.34.29',	'2020-12-26 20:35:45',	'103.118.34.29'),
(202,	21,	'I\'m an instant star. Just add water and stir.',	'#F1BEBA',	'2020-12-26 20:36:02',	'103.118.34.29',	'2020-12-26 20:36:02',	'103.118.34.29'),
(203,	21,	'I wanted to prove the sustaining power of music.',	'#CDA9A0',	'2020-12-26 20:36:24',	'103.118.34.29',	'2020-12-26 20:36:24',	'103.118.34.29'),
(204,	21,	'I\'m not a prophet or a stone aged man, just a mortal with potential of a superman. I\'m living on.',	'#F1A7FE',	'2020-12-26 20:36:44',	'103.118.34.29',	'2020-12-26 20:36:44',	'103.118.34.29'),
(205,	21,	'Fame itself… doesn’t really afford you anything more than a good seat in a restaurant.',	'#1E8896',	'2020-12-26 20:36:57',	'103.118.34.29',	'2020-12-26 20:36:57',	'103.118.34.29'),
(206,	21,	'I know when to go out, know when to stay in. Get things done.',	'#FFCA0A',	'2020-12-26 20:37:17',	'103.118.34.29',	'2020-12-26 20:37:17',	'103.118.34.29'),
(207,	21,	'Tomorrow belongs to those who can hear it coming.',	'#CDEDF6',	'2020-12-26 20:37:33',	'103.118.34.29',	'2020-12-26 20:37:33',	'103.118.34.29'),
(208,	21,	'As you get older, the questions come down to about two or three. How long? And what do I do with the time I\'ve got left?',	'#1E457C',	'2020-12-26 20:37:57',	'103.118.34.29',	'2020-12-26 20:37:57',	'103.118.34.29'),
(209,	21,	'I\'ve never responded well to entrenched negative thinking.',	'#1E457C',	'2020-12-26 20:38:13',	'103.118.34.29',	'2020-12-26 20:38:13',	'103.118.34.29'),
(210,	21,	'People have attention spans of five seconds and as much depth as a glass of water.',	'#CA7747',	'2020-12-26 20:38:28',	'103.118.34.29',	'2020-12-26 20:38:28',	'103.118.34.29'),
(211,	22,	'Stay humble. Don’t take away the power of the greatness that surrounds you.',	'#F8A1AE',	'2020-12-26 20:48:14',	'103.118.34.29',	'2020-12-26 20:48:14',	'103.118.34.29'),
(212,	22,	'Tall, curvy, short, thin, whatever you are, you are beautiful.',	'#2FA220',	'2020-12-26 20:48:31',	'103.118.34.29',	'2020-12-26 20:48:31',	'103.118.34.29'),
(213,	22,	'I used to think that confidence came from what other people thought about me but now I realize it comes from what I feel about myself.',	'#f5cb5c',	'2020-12-26 20:48:43',	'103.118.34.29',	'2020-12-26 20:48:43',	'103.118.34.29'),
(214,	22,	'You deserve to live a happy and healthy life.',	'#081c15',	'2020-12-26 20:48:55',	'103.118.34.29',	'2020-12-26 20:48:55',	'103.118.34.29'),
(215,	22,	'Your imperfections make you beautiful, they make you who you are.',	'#EDDB36',	'2020-12-26 20:49:08',	'103.118.34.29',	'2020-12-26 20:49:08',	'103.118.34.29'),
(216,	22,	'Nothing is more beautiful than the smile that has struggled through the tears.',	'#603043',	'2020-12-26 20:49:22',	'103.118.34.29',	'2020-12-26 20:49:22',	'103.118.34.29'),
(217,	22,	'Everyday is a new opportunity to change your life and be who you want to be.',	'#F4BBFF',	'2020-12-26 20:49:37',	'103.118.34.29',	'2020-12-26 20:49:37',	'103.118.34.29'),
(218,	22,	'It’s gonna be okay, no matter how hard rock bottom is, you can rise above it and you can come back.',	'#D84727',	'2020-12-26 20:49:51',	'103.118.34.29',	'2020-12-26 20:49:51',	'103.118.34.29'),
(219,	22,	'Don’t judge me. You know my name but not my story.',	'#E5D6BE',	'2020-12-26 20:50:09',	'103.118.34.29',	'2020-12-26 20:50:09',	'103.118.34.29'),
(220,	22,	'There are people whose voices aren’t being heard and I want to use my voice to speak up for them.',	'#F8A1AE',	'2020-12-26 20:50:39',	'103.118.34.29',	'2020-12-26 20:50:39',	'103.118.34.29'),
(221,	22,	'Love yourself for who you are and just keep going.',	'#C74D0C',	'2020-12-26 20:50:58',	'103.118.34.29',	'2020-12-26 20:50:58',	'103.118.34.29'),
(222,	22,	'Stay strong, be brave, love hard and true, and you will have nothing to lose.',	'#005695',	'2020-12-26 20:51:14',	'103.118.34.29',	'2020-12-26 20:51:14',	'103.118.34.29'),
(223,	22,	'I’m not going to sacrifice my mental health to have the perfect body.',	'#E32475',	'2020-12-26 20:51:37',	'103.118.34.29',	'2020-12-26 20:51:37',	'103.118.34.29'),
(224,	22,	'You’re stronger than you think you are. Keep pushing forward, never give up on your dreams, and don’t let anyone stop you.',	'#B57EDC',	'2020-12-26 20:51:52',	'103.118.34.29',	'2020-12-26 20:51:52',	'103.118.34.29'),
(225,	22,	'I pray every night before I go to sleep and every morning when I wake up.',	'#02c39a',	'2020-12-26 20:52:08',	'103.118.34.29',	'2020-12-26 20:52:08',	'103.118.34.29'),
(226,	23,	'I keep attracting ginger dudes who want to chat to me about their problems with being Ginger. It’s a bit weird.',	'#197687',	'2020-12-27 12:37:59',	'103.118.34.29',	'2020-12-27 12:37:59',	'103.118.34.29'),
(227,	23,	'Success is the best revenge for anything.',	'#5EB1BF',	'2020-12-27 12:38:15',	'103.118.34.29',	'2020-12-27 12:38:15',	'103.118.34.29'),
(228,	23,	'Before I save someone else, I have to save myself.',	'#F4879F',	'2020-12-27 12:38:31',	'103.118.34.29',	'2020-12-27 12:38:31',	'103.118.34.29'),
(229,	23,	'As far as songwriting, my inspirations came from love, life and death, and viewing other people’s situations.',	'#72efdd',	'2020-12-27 12:38:45',	'103.118.34.29',	'2020-12-27 12:38:45',	'103.118.34.29'),
(230,	23,	'I can’t tell you the key to success, but the key to failure is trying to please everyone.',	'#D1D5F2',	'2020-12-27 12:39:09',	'103.118.34.29',	'2020-12-27 12:39:09',	'103.118.34.29'),
(231,	23,	'The more you write tunes, the better they will become. The more you do gigs, the better you will become.',	'#734F96',	'2020-12-27 12:40:03',	'103.118.34.29',	'2020-12-27 12:40:03',	'103.118.34.29'),
(232,	23,	'A tongue has no bones, but it can break a heart.',	'#E74D91',	'2020-12-27 12:40:19',	'103.118.34.29',	'2020-12-27 12:40:19',	'103.118.34.29'),
(233,	23,	'You want to make sure that someone is there for you when you really need them, and not just there for you for the good times.',	'#bc4749',	'2020-12-27 12:40:35',	'103.118.34.29',	'2020-12-27 12:40:35',	'103.118.34.29'),
(234,	23,	'Be original; don’t be scared of being bold!',	'#877B76',	'2020-12-27 12:40:55',	'103.118.34.29',	'2020-12-27 12:40:55',	'103.118.34.29'),
(235,	23,	'The worst things in life come free to us.',	'#0E203D',	'2020-12-27 12:41:15',	'103.118.34.29',	'2020-12-27 12:41:15',	'103.118.34.29'),
(236,	23,	'I’ve had years of teasing about my red hair, but I definitely think it toughened me up. If you’re ginger, you end up pretty quick-witted.',	'#80ABE9',	'2020-12-27 12:41:34',	'103.118.34.29',	'2020-12-27 12:41:34',	'103.118.34.29'),
(237,	23,	'My love songs are very personal and quite weird. They don’t really have the big radio hit choruses because basically they’re my therapy, stuff I have to get off my chest.',	'#B0A49B',	'2020-12-27 12:41:50',	'103.118.34.29',	'2020-12-27 12:41:59',	'103.118.34.29'),
(238,	23,	'I think the music I’ve created is quite odd, and people are going to start talking about that.',	'#4047F9',	'2020-12-27 12:42:18',	'103.118.34.29',	'2020-12-27 12:42:18',	'103.118.34.29'),
(239,	23,	'Music is a powerful tool in galvanizing people around an issue. There’s no better way to get your point across than to put it in a beautiful song.',	'#9889F6',	'2020-12-27 12:42:31',	'103.118.34.29',	'2020-12-27 12:42:31',	'103.118.34.29'),
(240,	23,	'No one’s perfect. You make mistakes all the time. The key is to learn from them and not make the same mistakes again.',	'#5EB1BF',	'2020-12-27 12:42:47',	'103.118.34.29',	'2020-12-27 12:42:47',	'103.118.34.29'),
(241,	24,	'My head’s under water but I’m breathing fine.',	'#00b4d8',	'2020-12-27 12:47:20',	'103.118.34.29',	'2020-12-27 12:47:20',	'103.118.34.29'),
(242,	24,	'When you see people that are impoverished and people who are dealt an unfair hand, then if we have the power to help them, we should try to do that.',	'#F1BEBA',	'2020-12-27 12:49:54',	'103.118.34.29',	'2020-12-27 12:49:54',	'103.118.34.29'),
(243,	24,	'I’m craving more soul, I’m craving more truth, I’m craving more socially – just people that are aware of what’s going on in the world.',	'#CDA9A0',	'2020-12-27 12:50:11',	'103.118.34.29',	'2020-12-27 12:50:11',	'103.118.34.29'),
(244,	24,	'Sometimes there’s that perfect moment when the crowd, the music, the energy of the room come together in a way that brings me to tears.',	'#F263CF',	'2020-12-27 12:50:26',	'103.118.34.29',	'2020-12-27 12:50:26',	'103.118.34.29'),
(245,	24,	'Soul is about authenticity. Soul is about finding the things in your life that are real and pure.',	'#F1A7FE',	'2020-12-27 12:50:46',	'103.118.34.29',	'2020-12-27 12:50:46',	'103.118.34.29'),
(246,	24,	'All men should be feminist. If men care about women’s rights the world will be a better place.',	'#1E8896',	'2020-12-27 12:51:01',	'103.118.34.29',	'2020-12-27 12:51:01',	'103.118.34.29'),
(247,	24,	'My thoughts are stars, I can’t fathom into constellations.',	'#FFCA0A',	'2020-12-27 12:51:22',	'103.118.34.29',	'2020-12-27 12:51:22',	'103.118.34.29'),
(248,	24,	'Whatever awards come, they come. It’s going to be a fun night either way.',	'#CDEDF6',	'2020-12-27 12:51:37',	'103.118.34.29',	'2020-12-27 12:51:37',	'103.118.34.29'),
(249,	24,	'On the way we shed some tears. Every day we sacrifice. So we can be standing here. Oh what a hell of a life.',	'#1E457C',	'2020-12-27 12:51:53',	'103.118.34.29',	'2020-12-27 12:51:53',	'103.118.34.29'),
(250,	24,	'What great art is able to do is develop empathy in people so they can see other people’s perspectives.',	'#CA7747',	'2020-12-27 12:52:17',	'103.118.34.29',	'2020-12-27 12:52:17',	'103.118.34.29'),
(251,	24,	'The best training is to play by ear: trial by fire.',	'#F8A1AE',	'2020-12-27 12:52:32',	'103.118.34.29',	'2020-12-27 12:52:32',	'103.118.34.29'),
(252,	24,	'Althrough the end of all time. I will stay with you.',	'#2FA220',	'2020-12-27 12:52:52',	'103.118.34.29',	'2020-12-27 12:52:52',	'103.118.34.29'),
(253,	24,	'The ride for me has been good so far. I am blessed, because I enjoy doing what I am doing.',	'#f5cb5c',	'2020-12-27 12:53:07',	'103.118.34.29',	'2020-12-27 12:53:07',	'103.118.34.29'),
(254,	24,	'The future started yesterday, and we’re already late.',	'#081c15',	'2020-12-27 12:53:22',	'103.118.34.29',	'2020-12-27 12:53:22',	'103.118.34.29'),
(255,	24,	'When people are marching with our song, we want to tell you that we are with you, we see you, we love you, and march on.',	'#EDDB36',	'2020-12-27 12:53:37',	'103.118.34.29',	'2020-12-27 12:53:37',	'103.118.34.29'),
(256,	25,	'You cannot make a difference unless you’re different.',	'#603043',	'2020-12-27 12:59:18',	'103.118.34.29',	'2020-12-27 12:59:18',	'103.118.34.29'),
(257,	25,	'Talent doesn’t always equal success.',	'#F4BBFF',	'2020-12-27 13:01:47',	'103.118.34.29',	'2020-12-27 13:01:47',	'103.118.34.29'),
(258,	25,	'The grey area, the place between black and white – That’s the place where life happens.',	'#D84727',	'2020-12-27 13:02:01',	'103.118.34.29',	'2020-12-27 13:02:01',	'103.118.34.29'),
(259,	25,	'Everybody has their own path. It’s laid out for you. It’s just up to you to walk it.',	'#E5D6BE',	'2020-12-27 13:02:17',	'103.118.34.29',	'2020-12-27 13:02:17',	'103.118.34.29'),
(260,	25,	'I’m very thankful to be doing what I’m doing. I feel very blessed.',	'#F8A1AE',	'2020-12-27 13:02:33',	'103.118.34.29',	'2020-12-27 13:02:33',	'103.118.34.29'),
(261,	25,	'True leadership is when you are willing to risk your power and voice so that all of our can be heard.',	'#C74D0C',	'2020-12-27 13:02:48',	'103.118.34.29',	'2020-12-27 13:02:48',	'103.118.34.29'),
(262,	25,	'Your critics do not count. Their words will fade. You won’t.',	'#005695',	'2020-12-27 13:03:04',	'103.118.34.29',	'2020-12-27 13:03:04',	'103.118.34.29'),
(263,	25,	'The way I grew up, I was always taught that it’s uncouth to talk about money, and that’s not what should inspire you.',	'#E32475',	'2020-12-27 13:03:19',	'103.118.34.29',	'2020-12-27 13:03:19',	'103.118.34.29'),
(264,	25,	'As time goes by people will see who I am for who I am.',	'#B57EDC',	'2020-12-27 13:03:36',	'103.118.34.29',	'2020-12-27 13:03:36',	'103.118.34.29'),
(265,	25,	'I would never do anything just for spite.',	'#02c39a',	'2020-12-27 13:03:59',	'103.118.34.29',	'2020-12-27 13:03:59',	'103.118.34.29'),
(266,	25,	'Sexy, to me, is the way you carry what you have. I have a big nose, but I rock it.',	'#197687',	'2020-12-27 13:04:12',	'103.118.34.29',	'2020-12-27 13:04:12',	'103.118.34.29'),
(267,	25,	'The best part about being alone is that you really don’t have to answer to anybody. You do what you want.',	'#5EB1BF',	'2020-12-27 13:04:25',	'103.118.34.29',	'2020-12-27 13:04:25',	'103.118.34.29'),
(268,	25,	'Live now. Make now always the most precious time. Now will never come again.',	'#F4879F',	'2020-12-27 13:04:44',	'103.118.34.29',	'2020-12-27 13:04:44',	'103.118.34.29'),
(269,	25,	'The most boring thing in the world? Silence.',	'#72efdd',	'2020-12-27 13:04:59',	'103.118.34.29',	'2020-12-27 13:04:59',	'103.118.34.29'),
(270,	25,	'I’m a perfectionist. I can’t help it, I get really upset with myself if I fail in the least.',	'#D1D5F2',	'2020-12-27 13:05:12',	'103.118.34.29',	'2020-12-27 13:05:12',	'103.118.34.29'),
(271,	26,	'When you leave here tonight, know that at least one person believes in you.',	'#734F96',	'2020-12-27 13:13:47',	'103.118.34.29',	'2020-12-27 13:13:47',	'103.118.34.29'),
(272,	26,	'I won’t give up on my life as a warrior queen live passionately tonight.',	'#E74D91',	'2020-12-27 13:14:04',	'103.118.34.29',	'2020-12-27 13:14:04',	'103.118.34.29'),
(273,	26,	'Acceptance, tolerance, bravery, compassion. These are the things my mom taught me!',	'#bc4749',	'2020-12-27 13:14:18',	'103.118.34.29',	'2020-12-27 13:14:18',	'103.118.34.29'),
(274,	26,	'At the end of the day, you won’t be happy until you love yourself.',	'#877B76',	'2020-12-27 13:14:31',	'103.118.34.29',	'2020-12-27 13:14:31',	'103.118.34.29'),
(275,	26,	'If you don’t have any shadows you’re not in the light.',	'#0E203D',	'2020-12-27 13:14:44',	'103.118.34.29',	'2020-12-27 13:14:44',	'103.118.34.29'),
(276,	26,	'It’s always wrong to hate but its never wrong to love.',	'#80ABE9',	'2020-12-27 13:14:59',	'103.118.34.29',	'2020-12-27 13:14:59',	'103.118.34.29'),
(277,	26,	'You have to be careful about how much you reveal to people that look up to you so much.',	'#B0A49B',	'2020-12-27 13:15:21',	'103.118.34.29',	'2020-12-27 13:15:21',	'103.118.34.29'),
(278,	26,	'Trust is like a mirror, you can fix it if it’s broken, but you can still see the crack in that reflection.',	'#4047F9',	'2020-12-27 13:15:36',	'103.118.34.29',	'2020-12-27 13:15:36',	'103.118.34.29'),
(279,	26,	'We need fantasy to survive because reality is too difficult.',	'#9889F6',	'2020-12-27 13:15:49',	'103.118.34.29',	'2020-12-27 13:15:49',	'103.118.34.29'),
(280,	26,	'Born this way” is about being yourself, and loving who you are and being proud.',	'#5EB1BF',	'2020-12-27 13:16:03',	'103.118.34.29',	'2020-12-27 13:16:03',	'103.118.34.29'),
(281,	26,	'Money can run out but talent is forever.',	'#00b4d8',	'2020-12-27 13:16:18',	'103.118.34.29',	'2020-12-27 13:16:18',	'103.118.34.29'),
(282,	26,	'You define beauty yourself, society doesn’t define your beauty.',	'#F1BEBA',	'2020-12-27 13:16:32',	'103.118.34.29',	'2020-12-27 13:16:32',	'103.118.34.29'),
(283,	26,	'Don’t you ever let a soul in the world tell you that you can’t be exactly who you are.',	'#CDA9A0',	'2020-12-27 13:16:46',	'103.118.34.29',	'2020-12-27 13:16:46',	'103.118.34.29'),
(284,	26,	'You laugh at me because I’m different. I laugh at you because you are all the same. ',	'#F263CF',	'2020-12-27 13:17:00',	'103.118.34.29',	'2020-12-27 13:17:00',	'103.118.34.29'),
(285,	26,	'Celebrate all the things you don’t like about yourself. love yourself.',	'#F1A7FE',	'2020-12-27 13:17:18',	'103.118.34.29',	'2020-12-27 13:17:18',	'103.118.34.29'),
(286,	27,	'Life is a ruthless game unless you play it good and play it right.',	'#1E8896',	'2020-12-27 13:25:04',	'103.118.34.29',	'2020-12-27 13:25:04',	'103.118.34.29'),
(287,	27,	'Giving up doesn’t always mean you’re weak sometimes you’re just strong enough to let go.',	'#FFCA0A',	'2020-12-27 13:25:16',	'103.118.34.29',	'2020-12-27 13:25:16',	'103.118.34.29'),
(288,	27,	'I have this really high priority on happiness and finding something to be happy about.',	'#CDEDF6',	'2020-12-27 13:25:33',	'103.118.34.29',	'2020-12-27 13:25:33',	'103.118.34.29'),
(289,	27,	'I’m thankful that when I go to bed at night, that I have been myself that day. And I have been myself all the days before that.',	'#1E457C',	'2020-12-27 13:26:01',	'103.118.34.29',	'2020-12-27 13:26:01',	'103.118.34.29'),
(290,	27,	'Anytime someone tells me that I can’t do something, I want to do it more.',	'#CA7747',	'2020-12-27 13:26:20',	'103.118.34.29',	'2020-12-27 13:26:20',	'103.118.34.29'),
(291,	27,	'I’ve found time can heal most anything and you just mind find who you’re supposed to be.',	'#F8A1AE',	'2020-12-27 13:26:43',	'103.118.34.29',	'2020-12-27 13:26:43',	'103.118.34.29'),
(292,	27,	'Good memories can leave even more of a scar on your heart than the bad times.',	'#2FA220',	'2020-12-27 13:26:58',	'103.118.34.29',	'2020-12-27 13:26:58',	'103.118.34.29'),
(293,	27,	'I’m intimidated by the fear of being average.',	'#f5cb5c',	'2020-12-27 13:27:22',	'103.118.34.29',	'2020-12-27 13:27:22',	'103.118.34.29'),
(294,	27,	'In a relationship each person should support the other; they should lift each other up.',	'#081c15',	'2020-12-27 13:27:40',	'103.118.34.29',	'2020-12-27 13:27:40',	'103.118.34.29'),
(295,	27,	'So don’t you worry your pretty little mind, because people throw rocks at things that shine.',	'#EDDB36',	'2020-12-27 13:27:55',	'103.118.34.29',	'2020-12-27 13:27:55',	'103.118.34.29'),
(296,	27,	'Just be yourself, there is no one better.',	'#603043',	'2020-12-27 13:28:13',	'103.118.34.29',	'2020-12-27 13:28:13',	'103.118.34.29'),
(297,	27,	'You are not the opinion of someone who doesn’t know you.',	'#F4BBFF',	'2020-12-27 13:28:29',	'103.118.34.29',	'2020-12-27 13:28:29',	'103.118.34.29'),
(298,	27,	'I love making new friends and I respect people for a lot of different reason.',	'#D84727',	'2020-12-27 13:28:51',	'103.118.34.29',	'2020-12-27 13:29:00',	'103.118.34.29'),
(299,	27,	'In life, you learn lessons. And sometimes you learn them the hard way. Sometimes you learn them too late.',	'#F8A1AE',	'2020-12-27 13:29:16',	'103.118.34.29',	'2020-12-27 13:29:16',	'103.118.34.29'),
(300,	27,	'I think fearless is having fears but jumping anyway.',	'#005695',	'2020-12-27 13:30:01',	'103.118.34.29',	'2020-12-27 13:30:01',	'103.118.34.29'),
(301,	28,	'Music to me is like breathing. I don\'t get tired of breathing, I don\'t get tired of music.',	'#E32475',	'2020-12-27 13:37:39',	'103.118.34.29',	'2020-12-27 13:37:39',	'103.118.34.29'),
(302,	28,	'Love is a special word, and I use it only when I mean it. You say the word too much and it becomes cheap.',	'#B57EDC',	'2020-12-27 13:37:59',	'103.118.34.29',	'2020-12-27 13:37:59',	'103.118.34.29'),
(303,	28,	'The role of the designer is basically that of a good host, anticipating the needs of the guest.',	'#02c39a',	'2020-12-27 13:38:16',	'103.118.34.29',	'2020-12-27 13:38:16',	'103.118.34.29'),
(304,	28,	'What is a soul? It\'s like electricity - we don\'t really know what it is, but it\'s a force that can light a room.',	'#197687',	'2020-12-27 13:38:35',	'103.118.34.29',	'2020-12-27 13:38:35',	'103.118.34.29'),
(305,	28,	'If somebody don\'t like something that I do, that\'s his or her prerogative. Just like it\'s mine.',	'#5EB1BF',	'2020-12-27 13:39:19',	'103.118.34.29',	'2020-12-27 13:39:19',	'103.118.34.29'),
(306,	28,	'I got a cow that went dry and a hen that won\'t lay, a big stack of bills that gets bigger each day.',	'#F4879F',	'2020-12-27 13:39:36',	'103.118.34.29',	'2020-12-27 13:39:36',	'103.118.34.29'),
(307,	28,	'Just like you can buy grades of silk, you can buy grades of justice.',	'#72efdd',	'2020-12-27 13:40:01',	'103.118.34.29',	'2020-12-27 13:40:01',	'103.118.34.29'),
(308,	28,	'There are many spokes on the wheel of life. First, we\'re here to explore new possibilities.',	'#D1D5F2',	'2020-12-27 13:40:20',	'103.118.34.29',	'2020-12-27 13:40:20',	'103.118.34.29'),
(309,	28,	'I just want to make my mark, leave something musically good behind.',	'#734F96',	'2020-12-27 13:40:36',	'103.118.34.29',	'2020-12-27 13:40:36',	'103.118.34.29'),
(310,	28,	'The important thing is to feel your music, really feel it and believe it.',	'#E74D91',	'2020-12-27 13:40:56',	'103.118.34.29',	'2020-12-27 13:40:56',	'103.118.34.29'),
(311,	28,	'Live each day like it\'s your last, \'cause one day you gonna be right',	'#bc4749',	'2020-12-27 13:41:15',	'103.118.34.29',	'2020-12-27 13:41:15',	'103.118.34.29'),
(312,	28,	'Just because you can\'t see anything , doesn\'t mean you should shut your eyes.',	'#877B76',	'2020-12-27 13:41:27',	'103.118.34.29',	'2020-12-27 13:41:27',	'103.118.34.29'),
(313,	28,	'Dreams, if they\'re any good, are always a little bit crazy.',	'#0E203D',	'2020-12-27 13:41:43',	'103.118.34.29',	'2020-12-27 13:41:43',	'103.118.34.29'),
(314,	28,	'Music is nothing separate from me. It is me... You\'d have to remove the music surgically.',	'#80ABE9',	'2020-12-27 13:41:57',	'103.118.34.29',	'2020-12-27 13:41:57',	'103.118.34.29'),
(315,	29,	'Whatever you\'re going through in your life, don\'t ever give up.',	'#B0A49B',	'2020-12-27 13:50:05',	'103.118.34.29',	'2020-12-27 13:50:05',	'103.118.34.29'),
(316,	29,	'When you love someone so deeply they become your life, it\'s easy to succumb overwhelming fears inside. Blindly I imagined I could keep you under a glass. Now I understand to hold you I must open my hand and watch you rise.',	'#4047F9',	'2020-12-27 13:51:05',	'103.118.34.29',	'2020-12-27 13:51:05',	'103.118.34.29'),
(317,	29,	'I hope to be around past the 90\'s. I don\'t want to just be categorized as one of this era. My goal is to have a career that stands.',	'#9889F6',	'2020-12-27 13:51:23',	'103.118.34.29',	'2020-12-27 13:51:23',	'103.118.34.29'),
(318,	29,	'A lot of people are singing about how screwed up the world is, and I don\'t think that everybody wants to hear about that all the time.',	'#5EB1BF',	'2020-12-27 13:51:37',	'103.118.34.29',	'2020-12-27 13:51:37',	'103.118.34.29'),
(319,	29,	'I don\'t think anyone knows as much about what\'s right for me as I do.',	'#00b4d8',	'2020-12-27 13:51:52',	'103.118.34.29',	'2020-12-27 13:51:52',	'103.118.34.29'),
(320,	29,	'We have to go through certain things in order to appreciate life and learn lessons, I\'m just in a really good, comfortable, happy place.',	'#F1BEBA',	'2020-12-27 13:52:06',	'103.118.34.29',	'2020-12-27 13:52:06',	'103.118.34.29'),
(321,	29,	'I\'m proud of what I am and who I am, and I\'m just going to be myself.',	'#CDA9A0',	'2020-12-27 13:52:37',	'103.118.34.29',	'2020-12-27 13:52:37',	'103.118.34.29'),
(322,	29,	'I\'m really fortunate. I\'m really happy, and I\'m really really lucky to be where I am.',	'#F263CF',	'2020-12-27 13:52:58',	'103.118.34.29',	'2020-12-27 13:52:58',	'103.118.34.29'),
(323,	29,	'There is a light at the end of the tunnel... hopefully its not a freight train!',	'#1E8896',	'2020-12-27 13:53:14',	'103.118.34.29',	'2020-12-27 13:53:14',	'103.118.34.29'),
(324,	29,	'Never, never listen to anybody that tries to discourage you...',	'#FFCA0A',	'2020-12-27 13:53:31',	'103.118.34.29',	'2020-12-27 13:53:31',	'103.118.34.29'),
(325,	29,	'I look around and see the things I have, and I remember not having them. That is one thing that keeps me grounded. I\'m definitely the same person I was. . . . I never lose me, I never lose the real person.',	'#CDEDF6',	'2020-12-27 13:53:47',	'103.118.34.29',	'2020-12-27 13:53:47',	'103.118.34.29'),
(326,	29,	'See, I\'m looking for a man that\'ll rub me slow, make me sing real high when he goes down low.',	'#1E457C',	'2020-12-27 13:54:09',	'103.118.34.29',	'2020-12-27 13:54:09',	'103.118.34.29'),
(327,	29,	'I look at this moment as an incredible blessing. It\'s part of my struggle. It\'s made me a stronger person and made me appreciate this.',	'#CA7747',	'2020-12-27 13:54:29',	'103.118.34.29',	'2020-12-27 13:54:29',	'103.118.34.29'),
(328,	29,	'Everybody Out There.... Dont take ANYBODY for granted. Cause you never know when you might lose them, and you may never get the chance to tell them how you really feel',	'#F8A1AE',	'2020-12-27 13:54:57',	'103.118.34.29',	'2020-12-27 13:54:57',	'103.118.34.29'),
(329,	29,	'It\'s hard to be someone that people talk about and write about, you know? They don\'t know me.',	'#2FA220',	'2020-12-27 13:55:14',	'103.118.34.29',	'2020-12-27 13:55:14',	'103.118.34.29'),
(330,	29,	'I feel like it was just timing and that for the first time, I feel like this is an expression of who I am.',	'#f5cb5c',	'2020-12-27 13:55:26',	'103.118.34.29',	'2020-12-27 13:55:26',	'103.118.34.29'),
(331,	30,	'Don\'t you know how sweet and wonderful life can be?',	'#081c15',	'2020-12-27 13:59:44',	'103.118.34.29',	'2020-12-27 13:59:44',	'103.118.34.29'),
(332,	30,	'War is not the answer, for only love can conquer hate.',	'#EDDB36',	'2020-12-27 13:59:59',	'103.118.34.29',	'2020-12-27 13:59:59',	'103.118.34.29'),
(333,	30,	'Politics and hypocrites is turning us all into lunatics.',	'#603043',	'2020-12-27 14:01:03',	'103.118.34.29',	'2020-12-27 14:01:03',	'103.118.34.29'),
(334,	30,	'Great artists suffer for the people.',	'#F4BBFF',	'2020-12-27 14:01:25',	'103.118.34.29',	'2020-12-27 14:01:25',	'103.118.34.29'),
(335,	30,	'Who are they to judge us, simply because our hair is long?',	'#D84727',	'2020-12-27 14:01:39',	'103.118.34.29',	'2020-12-27 14:01:39',	'103.118.34.29'),
(336,	30,	'When I look at the world it fills me with sorrow, little children today are really going to suffer tomorrow.',	'#E5D6BE',	'2020-12-27 14:01:55',	'103.118.34.29',	'2020-12-27 14:01:55',	'103.118.34.29'),
(337,	30,	'I am not a star. At least, I don\'t consider myself a star.',	'#F8A1AE',	'2020-12-27 14:02:11',	'103.118.34.29',	'2020-12-27 14:02:11',	'103.118.34.29'),
(338,	30,	'Love your mother, she bore you. Love your father, he works for you.',	'#C74D0C',	'2020-12-27 14:02:33',	'103.118.34.29',	'2020-12-27 14:02:33',	'103.118.34.29'),
(339,	30,	'Music is one of the closest link-ups with God that we can probably experience. I think it\'s a common vibrating tone of the musical notes that holds all life together.',	'#005695',	'2020-12-27 14:02:56',	'103.118.34.29',	'2020-12-27 14:02:56',	'103.118.34.29'),
(340,	30,	'Let\'s save all the children, save the babies, save the babies.',	'#E32475',	'2020-12-27 14:03:17',	'103.118.34.29',	'2020-12-27 14:03:17',	'103.118.34.29'),
(341,	30,	'If you cannot find peace within yourself, you will never find it anywhere else.',	'#B57EDC',	'2020-12-27 14:03:36',	'103.118.34.29',	'2020-12-27 14:03:36',	'103.118.34.29'),
(342,	30,	'Marriage is miserable unless you find the right person that is your soulmate and that takes a lot of looking.',	'#02c39a',	'2020-12-27 14:03:52',	'103.118.34.29',	'2020-12-27 14:03:52',	'103.118.34.29'),
(343,	30,	'Give out some love and you\'ll find peace sublime.',	'#197687',	'2020-12-27 14:04:11',	'103.118.34.29',	'2020-12-27 14:04:11',	'103.118.34.29'),
(344,	30,	'There are still times I feel unhappy and I must smile, and there are times I want to cry and I must laugh... people rarely see the real Marvin Gaye',	'#5EB1BF',	'2020-12-27 14:04:28',	'103.118.34.29',	'2020-12-27 14:04:28',	'103.118.34.29'),
(345,	30,	'LIVE for LIFE, but let live everybody',	'#F4879F',	'2020-12-27 14:04:43',	'103.118.34.29',	'2020-12-27 14:04:43',	'103.118.34.29'),
(346,	31,	'I don\'t want to be famous, or recognizable.',	'#72efdd',	'2020-12-27 14:09:43',	'103.118.34.29',	'2020-12-27 14:09:43',	'103.118.34.29'),
(347,	31,	'I don\'t need to be rich anymore; I don\'t need to be a millionaire.',	'#D1D5F2',	'2020-12-27 14:09:58',	'103.118.34.29',	'2020-12-27 14:09:58',	'103.118.34.29'),
(348,	31,	'I may cry ruining my make up, Wash away all things you\'ve taken.. I don\'t care if I don\'t look pretty, Big girls cry when their hearts are breaking..',	'#734F96',	'2020-12-27 14:10:11',	'103.118.34.29',	'2020-12-27 14:10:11',	'103.118.34.29'),
(349,	31,	'I don’t read reviews or interviews or anything, just because I’m afraid; If I believed the good, then I’d believe the bad, and there will be bad.',	'#E74D91',	'2020-12-27 14:10:27',	'103.118.34.29',	'2020-12-27 14:10:27',	'103.118.34.29'),
(350,	31,	'I was weirdly obsessed with music until I was 11, and then I turned into a nerd.',	'#bc4749',	'2020-12-27 14:10:45',	'103.118.34.29',	'2020-12-27 14:10:45',	'103.118.34.29'),
(351,	31,	'Fame made me develop a panic disorder.',	'#877B76',	'2020-12-27 14:11:20',	'103.118.34.29',	'2020-12-27 14:11:20',	'103.118.34.29'),
(352,	31,	'I’m an advocate of ‘it’s not what you are, it’s who you are.’',	'#0E203D',	'2020-12-27 14:11:36',	'103.118.34.29',	'2020-12-27 14:11:36',	'103.118.34.29'),
(353,	31,	'I\'m sensitive and get easily upset and insulted.',	'#80ABE9',	'2020-12-27 14:13:05',	'103.118.34.29',	'2020-12-27 14:13:05',	'103.118.34.29'),
(354,	31,	'I\'m gonna live like tomorrow doesn\'t exist.',	'#B0A49B',	'2020-12-27 14:13:24',	'103.118.34.29',	'2020-12-27 14:13:24',	'103.118.34.29'),
(355,	31,	'When you\'re entertaining all day long and that\'s your work, you end up really very tired. You don\'t have a lot of energy left over for your loved ones.',	'#4047F9',	'2020-12-27 14:13:51',	'103.118.34.29',	'2020-12-27 14:13:51',	'103.118.34.29'),
(356,	31,	'Help, I have done it again I have been here many times before Hurt myself again today And the worst part is There\'s no-one else to blame.',	'#9889F6',	'2020-12-27 14:14:08',	'103.118.34.29',	'2020-12-27 14:14:08',	'103.118.34.29'),
(357,	31,	'I have social anxiety. It\'s easier up on stage because there\'s security in being there. When I\'m off stage I\'m trying not to be a manic freak. I\'m quite shy.',	'#5EB1BF',	'2020-12-27 14:14:24',	'103.118.34.29',	'2020-12-27 14:14:24',	'103.118.34.29'),
(358,	31,	'Being hunted, paparazzi-style , doesn\'t appeal to me.',	'#00b4d8',	'2020-12-27 14:14:47',	'103.118.34.29',	'2020-12-27 14:14:47',	'103.118.34.29'),
(359,	31,	'People aren\'t honest about the horrors of fame. The downsides are so overwhelming that, for me, there is no payoff.',	'#F1BEBA',	'2020-12-27 14:15:07',	'103.118.34.29',	'2020-12-27 14:15:07',	'103.118.34.29'),
(360,	31,	'If anyone besides famous people knew what it was like to be a famous person, they would never want to be famous.',	'#CDA9A0',	'2020-12-27 14:15:21',	'103.118.34.29',	'2020-12-27 14:15:21',	'103.118.34.29'),
(361,	32,	'Just because a man lacks the use of his eyes doesn’t mean he lacks vision.',	'#F263CF',	'2020-12-27 14:18:22',	'103.118.34.29',	'2020-12-27 14:18:22',	'103.118.34.29'),
(362,	32,	'Music is a world within itself, with a language we all understand.',	'#F1A7FE',	'2020-12-27 14:18:40',	'103.118.34.29',	'2020-12-27 14:18:40',	'103.118.34.29'),
(363,	32,	'The Lord that I serve says the impossible is unacceptable.',	'#1E8896',	'2020-12-27 14:18:57',	'103.118.34.29',	'2020-12-27 14:18:57',	'103.118.34.29'),
(364,	32,	'Let us come together before we’re annihilated.',	'#FFCA0A',	'2020-12-27 14:19:12',	'103.118.34.29',	'2020-12-27 14:19:12',	'103.118.34.29'),
(365,	32,	'There are a lot of things happening that show us that this, right now, is a time to love.',	'#CDEDF6',	'2020-12-27 14:19:26',	'103.118.34.29',	'2020-12-27 14:19:26',	'103.118.34.29'),
(366,	32,	'Ability may get you to the top, but it takes character to keep you there.',	'#1E457C',	'2020-12-27 14:19:45',	'103.118.34.29',	'2020-12-27 14:19:45',	'103.118.34.29'),
(367,	32,	'My mother had a rule, obviously, that I couldn’t go across the street by myself, but I had to find a way of doing it.',	'#CA7747',	'2020-12-27 14:22:37',	'103.118.34.29',	'2020-12-27 14:22:37',	'103.118.34.29'),
(368,	32,	'We all have hearts… If you have a heart, love somebody. If you have enough heart, love everybody.',	'#F8A1AE',	'2020-12-27 14:23:07',	'103.118.34.29',	'2020-12-27 14:23:07',	'103.118.34.29'),
(369,	32,	'Fear can’t put dreams to sleep.',	'#2FA220',	'2020-12-27 14:23:22',	'103.118.34.29',	'2020-12-27 14:23:22',	'103.118.34.29'),
(370,	32,	'I am all for anything that is going to better equip a person who is physically challenged in any way, to have an opportunity to be able to do what they are able to do.',	'#f5cb5c',	'2020-12-27 14:23:39',	'103.118.34.29',	'2020-12-27 14:23:39',	'103.118.34.29'),
(371,	32,	'You can’t base your life on other people’s expectations.',	'#081c15',	'2020-12-27 14:24:27',	'103.118.34.29',	'2020-12-27 14:24:27',	'103.118.34.29'),
(372,	32,	'Minds ripen at very different ages.',	'#EDDB36',	'2020-12-27 14:25:20',	'103.118.34.29',	'2020-12-27 14:25:20',	'103.118.34.29'),
(373,	32,	'What I’m not confused about is the world needing much more love, no hate, no prejudice, no bigotry and more unity, peace and understanding. Period.',	'#603043',	'2020-12-27 14:25:45',	'103.118.34.29',	'2020-12-27 14:25:45',	'103.118.34.29'),
(374,	32,	'Music, at its essence, is what gives us memories. And the longer a song has existed in our lives, the more memories we have of it.',	'#F4BBFF',	'2020-12-27 14:26:01',	'103.118.34.29',	'2020-12-27 14:26:01',	'103.118.34.29'),
(375,	33,	'I am because we are. We all bleed the same color. We all want to love and be loved.',	'#D84727',	'2020-12-27 14:31:22',	'103.118.34.29',	'2020-12-27 14:31:22',	'103.118.34.29'),
(376,	33,	'It’s not my nature to just kick back.',	'#E5D6BE',	'2020-12-27 14:34:47',	'103.118.34.29',	'2020-12-27 14:34:47',	'103.118.34.29'),
(377,	33,	'I’ve been popular and unpopular successful and unsuccessful loved and loathed and I know how meaningless it all is. Therefore I feel free to take whatever risks I want.',	'#F8A1AE',	'2020-12-27 14:35:09',	'103.118.34.29',	'2020-12-27 14:35:09',	'103.118.34.29'),
(378,	33,	'Better to live one year as a tiger, than a hundred as a sheep.',	'#C74D0C',	'2020-12-27 14:35:37',	'103.118.34.29',	'2020-12-27 14:35:37',	'103.118.34.29'),
(379,	33,	'Never forget to dream.',	'#005695',	'2020-12-27 14:35:49',	'103.118.34.29',	'2020-12-27 14:35:49',	'103.118.34.29'),
(380,	33,	'Only when I’m dancing can I feel this free.',	'#E32475',	'2020-12-27 14:36:08',	'103.118.34.29',	'2020-12-27 14:36:08',	'103.118.34.29'),
(381,	33,	'Children always understand. They have open minds. They have built-in shit detectors.',	'#B57EDC',	'2020-12-27 14:36:24',	'103.118.34.29',	'2020-12-27 14:36:24',	'103.118.34.29'),
(382,	33,	'No matter who you are, no matter what you did, no matter where you’ve come from, you can always change, become a better version of yourself.',	'#02c39a',	'2020-12-27 14:36:40',	'103.118.34.29',	'2020-12-27 14:36:40',	'103.118.34.29'),
(383,	33,	'I wouldn’t have turned out the way I was if I didn’t have all those old-fashioned values to rebel against.',	'#197687',	'2020-12-27 14:36:54',	'103.118.34.29',	'2020-12-27 14:36:54',	'103.118.34.29'),
(384,	33,	'I am my own experiment. I am my own work of art.',	'#5EB1BF',	'2020-12-27 14:37:20',	'103.118.34.29',	'2020-12-27 14:37:20',	'103.118.34.29'),
(385,	33,	'I want to be like Gandhi and Martin Luther King and John Lennon but I want to Stay Alive.',	'#F4879F',	'2020-12-27 14:37:46',	'103.118.34.29',	'2020-12-27 14:37:46',	'103.118.34.29'),
(386,	33,	'I think you can be defiant and rebellious and still be strong and positive.',	'#72efdd',	'2020-12-27 14:38:12',	'103.118.34.29',	'2020-12-27 14:38:12',	'103.118.34.29'),
(387,	33,	'A lot of people are afraid to say what they want. That’s why they don’t get what they want.',	'#D1D5F2',	'2020-12-27 14:38:32',	'103.118.34.29',	'2020-12-27 14:38:32',	'103.118.34.29'),
(388,	33,	'Power is being told you’re not loved and not being destroyed by it.',	'#734F96',	'2020-12-27 14:38:50',	'103.118.34.29',	'2020-12-27 14:38:50',	'103.118.34.29'),
(389,	33,	'Listen, everyone is entitled to my opinion.',	'#E74D91',	'2020-12-27 14:39:10',	'103.118.34.29',	'2020-12-27 14:39:10',	'103.118.34.29'),
(390,	34,	'When life puts you in tough situations, don’t say why me, say try me.',	'#bc4749',	'2020-12-27 15:18:27',	'103.118.34.29',	'2020-12-27 15:18:27',	'103.118.34.29'),
(391,	34,	'And hope you find it, what you’re looking for, and I hope it’s everything you dreamed your life could be and so much more.',	'#877B76',	'2020-12-27 15:18:41',	'103.118.34.29',	'2020-12-27 15:18:41',	'103.118.34.29'),
(392,	34,	'You need to see things, really see them, feel them, live them, so you know what’s big and what’s little, what matters and what to put aside.',	'#0E203D',	'2020-12-27 15:18:56',	'103.118.34.29',	'2020-12-27 15:18:56',	'103.118.34.29'),
(393,	34,	'The greatest opportunities in life come with fear and risk.',	'#80ABE9',	'2020-12-27 15:19:11',	'103.118.34.29',	'2020-12-27 15:19:11',	'103.118.34.29'),
(394,	34,	'You can’t stop people from talking about you, but you can stop giving them something to talk about.',	'#B0A49B',	'2020-12-27 15:20:08',	'103.118.34.29',	'2020-12-27 15:20:08',	'103.118.34.29'),
(395,	34,	'Life’s what you make it.',	'#4047F9',	'2020-12-27 15:20:22',	'103.118.34.29',	'2020-12-27 15:20:22',	'103.118.34.29'),
(396,	34,	'Embarrassment is the worst! It’s the feeling of having your entire body go numb and not knowing what to do with yourself for that one moment.',	'#9889F6',	'2020-12-27 15:20:36',	'103.118.34.29',	'2020-12-27 15:20:36',	'103.118.34.29'),
(397,	34,	'Do what you are afraid to do.',	'#5EB1BF',	'2020-12-27 15:20:48',	'103.118.34.29',	'2020-12-27 15:20:48',	'103.118.34.29'),
(398,	34,	'It’s hard to imagine that our love is a story with an end. But you know, at least I’m getting some really good songs out of it.',	'#00b4d8',	'2020-12-27 15:21:20',	'103.118.34.29',	'2020-12-27 15:21:20',	'103.118.34.29'),
(399,	34,	'Little moments attach themselves to other little moments and collect into big dreams. We become what we experience.',	'#F1BEBA',	'2020-12-27 15:21:34',	'103.118.34.29',	'2020-12-27 15:21:34',	'103.118.34.29'),
(400,	34,	'I learned from you that I do not crumble. I learned that strength is something you choose.',	'#CDA9A0',	'2020-12-27 15:21:55',	'103.118.34.29',	'2020-12-27 15:21:55',	'103.118.34.29'),
(401,	34,	'The minute you stop making mistakes is the minute you stop learning.',	'#F263CF',	'2020-12-27 15:22:12',	'103.118.34.29',	'2020-12-27 15:22:12',	'103.118.34.29'),
(402,	34,	'It’s the little things that make us who we are in the bigger world.',	'#F1A7FE',	'2020-12-27 15:22:28',	'103.118.34.29',	'2020-12-27 15:22:28',	'103.118.34.29'),
(403,	34,	'I’m just a girl, with a dream that got the best of me, in a world that believes fame is everything.',	'#1E8896',	'2020-12-27 15:22:42',	'103.118.34.29',	'2020-12-27 15:22:42',	'103.118.34.29'),
(404,	34,	'Maybe it’s your time to lift off and fly. You won’t know if you never try.',	'#FFCA0A',	'2020-12-27 15:23:02',	'103.118.34.29',	'2020-12-27 15:23:02',	'103.118.34.29'),
(405,	34,	'For every action there is an equal and opposite reaction. You never know what it’s going to look like on the other side, but you’ll see it eventually if you keep your eyes open.',	'#CDEDF6',	'2020-12-27 15:23:17',	'103.118.34.29',	'2020-12-27 15:23:17',	'103.118.34.29'),
(406,	35,	'It’s really fun to put yourself into a character – into shoes you wouldn’t normally be in. ',	'#1E457C',	'2020-12-27 15:30:51',	'103.118.34.29',	'2020-12-27 15:30:51',	'103.118.34.29'),
(407,	35,	'I feel like I write so that people can think of it as theirs. If my song is exactly about your life right now, then it is. I don’t even want to say that it’s mine, because it’s yours.',	'#CA7747',	'2020-12-27 15:31:20',	'103.118.34.29',	'2020-12-27 15:31:20',	'103.118.34.29'),
(408,	35,	'I never thought a career as a musician was possible.',	'#F8A1AE',	'2020-12-27 15:31:37',	'103.118.34.29',	'2020-12-27 15:31:37',	'103.118.34.29'),
(409,	35,	'Sometimes it’s flattering when people copy you, but sometimes it gets to a breaking point.',	'#2FA220',	'2020-12-27 15:32:04',	'103.118.34.29',	'2020-12-27 15:32:04',	'103.118.34.29'),
(410,	35,	'I don’t know how to function without music. When I’m not making it, I’m listening to it. It gives me courage and takes care of my mind.',	'#081c15',	'2020-12-27 15:32:25',	'103.118.34.29',	'2020-12-27 15:32:25',	'103.118.34.29'),
(411,	35,	'When I write, I try to become different characters.',	'#EDDB36',	'2020-12-27 15:32:39',	'103.118.34.29',	'2020-12-27 15:32:39',	'103.118.34.29'),
(412,	35,	'Lyrics are so important, but they’re really underrated.',	'#603043',	'2020-12-27 15:32:57',	'103.118.34.29',	'2020-12-27 15:32:57',	'103.118.34.29'),
(413,	35,	'I don’t belong to anyone, but everybody knows my name.',	'#F4BBFF',	'2020-12-27 15:33:17',	'103.118.34.29',	'2020-12-27 15:33:17',	'103.118.34.29'),
(414,	35,	'Clothing & fashion are kind of my security blanket, almost.',	'#D84727',	'2020-12-27 15:33:47',	'103.118.34.29',	'2020-12-27 15:33:47',	'103.118.34.29'),
(415,	35,	'I’ve always been a singer. I never really decided I was gonna be a singer. It just kind of – I just sing a lot.',	'#E5D6BE',	'2020-12-27 15:34:12',	'103.118.34.29',	'2020-12-27 15:34:12',	'103.118.34.29'),
(416,	35,	'You can write a song about being in love with someone, but you don’t have to be in love with anyone.',	'#F8A1AE',	'2020-12-27 15:34:31',	'103.118.34.29',	'2020-12-27 15:34:31',	'103.118.34.29'),
(417,	35,	'I like to be in control of how I look and how I feel and how I act.',	'#C74D0C',	'2020-12-27 15:35:18',	'103.118.34.29',	'2020-12-27 15:35:18',	'103.118.34.29'),
(418,	35,	'I’m gonna make what I want to make, and other people are gonna like what they’re gonna like. It doesn’t really matter.',	'#005695',	'2020-12-27 15:35:32',	'103.118.34.29',	'2020-12-27 15:35:32',	'103.118.34.29'),
(419,	35,	'I listen to music all day every day. I can’t not listen to music. It’s kind of scary how much I listen to music, but it’s what I love, and it’s all I care about, so I’m good with it.',	'#E32475',	'2020-12-27 15:35:53',	'103.118.34.29',	'2020-12-27 15:35:53',	'103.118.34.29'),
(420,	35,	'I don’t think a song should be put in a category.',	'#B57EDC',	'2020-12-27 15:36:11',	'103.118.34.29',	'2020-12-27 15:36:11',	'103.118.34.29'),
(421,	36,	'Being yourself is all it takes. If you want to impress someone don’t be someone else just be yourself.',	'#02c39a',	'2020-12-27 15:44:55',	'103.118.34.29',	'2020-12-27 15:44:55',	'103.118.34.29'),
(422,	36,	'You are not defined by an Instagram photo, by a like, by a comment. That does not define you.',	'#197687',	'2020-12-27 15:45:14',	'103.118.34.29',	'2020-12-27 15:45:24',	'103.118.34.29'),
(423,	36,	'Being single can pave the way for new opportunities.',	'#5EB1BF',	'2020-12-27 15:48:19',	'103.118.34.29',	'2020-12-27 15:48:19',	'103.118.34.29'),
(424,	36,	'Never look back. If Cinderella had looked back and picked up the shoe she would have never found her prince.',	'#F4879F',	'2020-12-27 15:49:13',	'103.118.34.29',	'2020-12-27 15:49:13',	'103.118.34.29'),
(425,	36,	'I have a right to live my life and just be me with whoever I choose. We just do the best we can.',	'#72efdd',	'2020-12-27 15:50:08',	'103.118.34.29',	'2020-12-27 15:50:08',	'103.118.34.29'),
(426,	36,	'Making new friends is tough. You don’t really know who to trust when you’re away from people that you love a lot.',	'#D1D5F2',	'2020-12-27 15:51:51',	'103.118.34.29',	'2020-12-27 15:51:51',	'103.118.34.29'),
(427,	36,	'I don’t like hiding. I do like to keep certain things to myself, but at the end of the day, I’m eighteen, and I’m going to fall in love.',	'#734F96',	'2020-12-27 15:52:02',	'103.118.34.29',	'2020-12-27 15:52:02',	'103.118.34.29'),
(428,	36,	'You have the right to live a beautiful life',	'#E74D91',	'2020-12-27 15:52:20',	'103.118.34.29',	'2020-12-27 15:52:20',	'103.118.34.29'),
(429,	36,	'And during… sometimes you wanna just be you with someone who knows all your secrets',	'#bc4749',	'2020-12-27 15:52:35',	'103.118.34.29',	'2020-12-27 15:52:35',	'103.118.34.29'),
(430,	36,	'One of my favorite songs I’ve ever done is Who Says, and I was 17 when I recorded that song. It was just so exactly what I felt, during that time. That’s when I knew how powerful music is.',	'#877B76',	'2020-12-27 15:52:51',	'103.118.34.29',	'2020-12-27 15:52:51',	'103.118.34.29'),
(431,	36,	'Artistically, you want to be able to do a lot of things that can challenge you to not just stay in the same thing.',	'#0E203D',	'2020-12-27 15:53:04',	'103.118.34.29',	'2020-12-27 15:53:04',	'103.118.34.29'),
(432,	36,	'I feel like I should be able to be 18 and have the friends that I choose and to have fun and live my life.',	'#80ABE9',	'2020-12-27 15:53:21',	'103.118.34.29',	'2020-12-27 15:53:21',	'103.118.34.29'),
(433,	36,	'Everything happens for a reason and, something better will come along for me!',	'#B0A49B',	'2020-12-27 15:53:33',	'103.118.34.29',	'2020-12-27 15:53:33',	'103.118.34.29'),
(434,	36,	'I realize everybody wants what they don’t have. But at the end of the day, what you have inside is much more beautiful than what’s on the outside!',	'#4047F9',	'2020-12-27 15:53:50',	'103.118.34.29',	'2020-12-27 15:53:50',	'103.118.34.29'),
(435,	36,	'There’s a million reasons why I should give you up. But the heart wants what it wants.',	'#9889F6',	'2020-12-27 15:54:05',	'103.118.34.29',	'2020-12-27 15:54:05',	'103.118.34.29'),
(436,	37,	'The whole business is built on ego, vanity, self-satisfaction, and it’s total crap to pretend it’s not.',	'#5EB1BF',	'2020-12-27 16:07:10',	'103.118.34.29',	'2020-12-27 16:07:10',	'103.118.34.29'),
(437,	37,	'You’ll never find peace of mind until you listen to your heart.',	'#00b4d8',	'2020-12-27 16:07:57',	'103.118.34.29',	'2020-12-27 16:07:57',	'103.118.34.29'),
(438,	37,	'I have the audience I deserve. Or at least I have the audience that represents the kind of people that I like.',	'#F1BEBA',	'2020-12-27 16:08:17',	'103.118.34.29',	'2020-12-27 16:08:17',	'103.118.34.29'),
(439,	37,	'I’ve achieved what every artist wants, which that some of their work will outlive them.',	'#CDA9A0',	'2020-12-27 16:08:31',	'103.118.34.29',	'2020-12-27 16:08:31',	'103.118.34.29'),
(440,	37,	'It helps if you have a beard as it covers a multitude of sins. It really does.',	'#F263CF',	'2020-12-27 16:08:47',	'103.118.34.29',	'2020-12-27 16:08:47',	'103.118.34.29'),
(441,	37,	'I spent years growing up being told what my sexuality was.',	'#F1A7FE',	'2020-12-27 16:09:03',	'103.118.34.29',	'2020-12-27 16:09:03',	'103.118.34.29'),
(442,	37,	'I still believe that music is one of the greatest gifts that God gave to man.',	'#1E8896',	'2020-12-27 16:14:57',	'103.118.34.29',	'2020-12-27 16:15:27',	'103.118.34.29'),
(443,	37,	'There is no such thing as a reluctant star.',	'#FFCA0A',	'2020-12-27 16:15:10',	'103.118.34.29',	'2020-12-27 16:15:10',	'103.118.34.29'),
(444,	37,	'Playing with Queen was the biggest moment of my career. It was like living a childhood fantasy.',	'#CDEDF6',	'2020-12-27 16:15:52',	'103.118.34.29',	'2020-12-27 16:15:52',	'103.118.34.29'),
(445,	37,	'As you become older, you become more selective. Most celebrities bore me to tears.',	'#1E457C',	'2020-12-27 16:16:16',	'103.118.34.29',	'2020-12-27 16:16:16',	'103.118.34.29'),
(446,	37,	'Maybe I needed physical adulation to make up for things I didn’t see in myself. … I realize it’s not everything to be attractive.',	'#CA7747',	'2020-12-27 16:16:35',	'103.118.34.29',	'2020-12-27 16:16:35',	'103.118.34.29'),
(447,	37,	'Is my body a temple, or is my life a temple? I’m definitely in the latter category and I think my life has been better since thinking that way.',	'#F8A1AE',	'2020-12-27 16:16:48',	'103.118.34.29',	'2020-12-27 16:16:48',	'103.118.34.29'),
(448,	37,	'I don’t really have any traits that I deplore. I get annoyed with myself sometimes, but that’s about it.',	'#2FA220',	'2020-12-27 16:17:02',	'103.118.34.29',	'2020-12-27 16:17:02',	'103.118.34.29'),
(449,	37,	'I think my idea of a perfect romance is when when two people really belong to each other.',	'#f5cb5c',	'2020-12-27 16:17:21',	'103.118.34.29',	'2020-12-27 16:17:21',	'103.118.34.29'),
(450,	37,	'There’s no comfort in the truth, pain is all you’ll find.',	'#081c15',	'2020-12-27 16:17:36',	'103.118.34.29',	'2020-12-27 16:17:36',	'103.118.34.29'),
(451,	38,	'Nobody can understand what you’re feeling unless they burn the way you burned.',	'#EDDB36',	'2020-12-27 16:20:42',	'103.118.34.29',	'2020-12-27 16:20:42',	'103.118.34.29'),
(452,	38,	'It’s nice to look back on your life and see things as lessons, and not regrets.',	'#603043',	'2020-12-27 16:21:08',	'103.118.34.29',	'2020-12-27 16:21:08',	'103.118.34.29'),
(453,	38,	'It’s tougher to be vulnerable than to actually be tough.',	'#F4BBFF',	'2020-12-27 16:21:25',	'103.118.34.29',	'2020-12-27 16:21:25',	'103.118.34.29'),
(454,	38,	'Hurt me with the truth. Don’t comfort me with a lie.',	'#D84727',	'2020-12-27 16:22:19',	'103.118.34.29',	'2020-12-27 16:22:19',	'103.118.34.29'),
(455,	38,	'I think a lot of people are afraid of being happy because of what others might think.',	'#E5D6BE',	'2020-12-27 16:24:11',	'103.118.34.29',	'2020-12-27 16:24:11',	'103.118.34.29'),
(456,	38,	'Because tomorrow I’m still going to be the same person. I’m still going to do what I want to do.',	'#F8A1AE',	'2020-12-27 16:24:23',	'103.118.34.29',	'2020-12-27 16:24:23',	'103.118.34.29'),
(457,	38,	'I am a child but I have to think and act like a woman, this business forces you to.',	'#C74D0C',	'2020-12-27 16:24:40',	'103.118.34.29',	'2020-12-27 16:24:40',	'103.118.34.29'),
(458,	38,	'You don’t want to live your life and then meet someone. You want to share your life with someone. That’s what I’m missing right now.',	'#005695',	'2020-12-27 16:24:54',	'103.118.34.29',	'2020-12-27 16:24:54',	'103.118.34.29'),
(459,	38,	'Don’t hide from who you are.',	'#E32475',	'2020-12-27 16:25:10',	'103.118.34.29',	'2020-12-27 16:25:10',	'103.118.34.29'),
(460,	38,	'You may never be good enough for everybody, but you will always be the best for somebody.',	'#B57EDC',	'2020-12-27 16:25:24',	'103.118.34.29',	'2020-12-27 16:25:24',	'103.118.34.29'),
(461,	38,	'I don’t do things for the response or the controversy. I just live my life.',	'#02c39a',	'2020-12-27 16:25:39',	'103.118.34.29',	'2020-12-27 16:25:39',	'103.118.34.29'),
(462,	38,	'You almost feel ashamed, that someone could be that important that without them, you feel like nothing.',	'#197687',	'2020-12-27 16:26:20',	'103.118.34.29',	'2020-12-27 16:26:20',	'103.118.34.29'),
(463,	38,	'I stand up for what I believe in, and a lot of the time that can be against people’s opinions.',	'#5EB1BF',	'2020-12-27 16:26:35',	'103.118.34.29',	'2020-12-27 16:26:35',	'103.118.34.29'),
(464,	38,	'Let go of the things that make you feel dead! Life is worth living!',	'#F4879F',	'2020-12-27 16:26:53',	'103.118.34.29',	'2020-12-27 16:26:53',	'103.118.34.29'),
(465,	38,	'If I cry, it’s because I’m very angry and I can’t do anything about it because I’ve run into a dead end. That’s when the tears would come down.',	'#72efdd',	'2020-12-27 16:27:06',	'103.118.34.29',	'2020-12-27 16:27:06',	'103.118.34.29'),
(466,	39,	'You should not be afraid of doing what your mind tells you to do, just listen to your heart.',	'#D1D5F2',	'2020-12-27 16:34:52',	'103.118.34.29',	'2020-12-27 16:34:52',	'103.118.34.29'),
(467,	39,	'I’m not a fighter by nature, but, if I believe in something, I stand up for it.',	'#734F96',	'2020-12-27 16:35:05',	'103.118.34.29',	'2020-12-27 16:35:05',	'103.118.34.29'),
(468,	39,	'Stay positive. Stay strong and learn to be better and always live to serve others and The Lord.',	'#E74D91',	'2020-12-27 16:35:20',	'103.118.34.29',	'2020-12-27 16:35:20',	'103.118.34.29'),
(469,	39,	'I make mistakes growing up. I’m not perfect; I’m not a robot.',	'#bc4749',	'2020-12-27 16:35:40',	'103.118.34.29',	'2020-12-27 16:35:40',	'103.118.34.29'),
(470,	39,	'I’m happy with the man I’m becoming.',	'#877B76',	'2020-12-27 16:36:00',	'103.118.34.29',	'2020-12-27 16:36:00',	'103.118.34.29'),
(471,	39,	'As I get into it more, I want to grow as an artist, as an entertainer, and basically perfect my craft.',	'#0E203D',	'2020-12-27 16:36:14',	'103.118.34.29',	'2020-12-27 16:36:14',	'103.118.34.29'),
(472,	39,	'I’m living proof that dreams do come true. Work hard. Pray. Believe.',	'#80ABE9',	'2020-12-27 16:36:30',	'103.118.34.29',	'2020-12-27 16:36:30',	'103.118.34.29'),
(473,	39,	'Everything starts from something.',	'#9889F6',	'2020-12-27 16:36:53',	'103.118.34.29',	'2020-12-27 16:36:53',	'103.118.34.29'),
(474,	39,	'There’s gonna be times in life when people tell you that you can’t, that’s when you just gotta turn around and say watch me.',	'#00b4d8',	'2020-12-27 16:37:17',	'103.118.34.29',	'2020-12-27 16:37:17',	'103.118.34.29'),
(475,	39,	'It’s cool when fans spend so much time making things for me. It means a lot.',	'#CDA9A0',	'2020-12-27 16:37:33',	'103.118.34.29',	'2020-12-27 16:37:33',	'103.118.34.29'),
(476,	39,	'You can’t fly unless you let yourself fall.',	'#F1A7FE',	'2020-12-27 16:37:49',	'103.118.34.29',	'2020-12-27 16:37:49',	'103.118.34.29'),
(477,	39,	'When life pushes you down on your knees you’re in the perfect position to pray.',	'#FFCA0A',	'2020-12-27 16:38:13',	'103.118.34.29',	'2020-12-27 16:38:13',	'103.118.34.29'),
(478,	39,	'I will never say never I will fight I will fight till forever.',	'#1E457C',	'2020-12-27 16:38:36',	'103.118.34.29',	'2020-12-27 16:38:36',	'103.118.34.29'),
(479,	39,	'If you don’t dream big, there’s no use of dreaming. If you don’t have faith, there’s nothing worth believing.',	'#F8A1AE',	'2020-12-27 16:38:55',	'103.118.34.29',	'2020-12-27 16:38:55',	'103.118.34.29'),
(480,	39,	'The success I’ve achieved comes to me from God.',	'#f5cb5c',	'2020-12-27 16:39:10',	'103.118.34.29',	'2020-12-27 16:39:10',	'103.118.34.29'),
(481,	40,	'There’s still time to change the road you’re on…',	'#EDDB36',	'2020-12-27 16:43:43',	'103.118.34.29',	'2020-12-27 16:43:43',	'103.118.34.29'),
(482,	40,	'You know sometimes words have two meanings.',	'#F4BBFF',	'2020-12-27 16:43:55',	'103.118.34.29',	'2020-12-27 16:43:55',	'103.118.34.29'),
(483,	40,	'When you’re 20 years old and you’re making points with volume and dynamism, it’s a fantastic thing to do.',	'#E5D6BE',	'2020-12-27 16:44:17',	'103.118.34.29',	'2020-12-27 16:44:17',	'103.118.34.29'),
(484,	40,	'You have nothing. One should never allow themselves to think that they have, one can just touch – to have is to lack appreciation, to touch is to want to touch again.',	'#E32475',	'2020-12-27 16:44:35',	'103.118.34.29',	'2020-12-27 16:44:35',	'103.118.34.29'),
(485,	40,	'As we wind on down the road, our shadows taller than our souls.',	'#02c39a',	'2020-12-27 16:44:49',	'103.118.34.29',	'2020-12-27 16:44:49',	'103.118.34.29'),
(486,	40,	'Some audiences can shake and bang their heads on the stage to riffs all night long, but subtlety is an art that must be mastered if you’re going to be remembered.',	'#5EB1BF',	'2020-12-27 16:45:04',	'103.118.34.29',	'2020-12-27 16:45:04',	'103.118.34.29'),
(487,	40,	'The calendar and the mirror – they’re bastards.',	'#72efdd',	'2020-12-27 16:45:16',	'103.118.34.29',	'2020-12-27 16:45:16',	'103.118.34.29'),
(488,	40,	'There’s no point stepping up to the golden platform if you’re going to repeat yourself.',	'#734F96',	'2020-12-27 16:45:36',	'103.118.34.29',	'2020-12-27 16:45:36',	'103.118.34.29'),
(489,	40,	'The whole idea of music, from the beginning of time, was for people to be happy',	'#bc4749',	'2020-12-27 16:45:58',	'103.118.34.29',	'2020-12-27 16:45:58',	'103.118.34.29'),
(490,	40,	'I think that passion and love and pain are all bearable, and they go to make love beautiful.',	'#0E203D',	'2020-12-27 16:46:12',	'103.118.34.29',	'2020-12-27 16:46:12',	'103.118.34.29'),
(491,	40,	'The past is a stepping stone, not a millstone.',	'#80ABE9',	'2020-12-27 16:47:09',	'103.118.34.29',	'2020-12-27 16:47:09',	'103.118.34.29'),
(492,	40,	'Life isn’t moving quickly – time moves very quickly. ',	'#4047F9',	'2020-12-27 16:47:25',	'103.118.34.29',	'2020-12-27 16:47:25',	'103.118.34.29'),
(493,	40,	'I think that passion and love and pain are all bearable, and they go to make love beautiful.',	'#5EB1BF',	'2020-12-27 16:47:41',	'103.118.34.29',	'2020-12-27 16:47:41',	'103.118.34.29'),
(494,	40,	'You know, people can’t fall in love with me just because I’m good at what I do.',	'#F1BEBA',	'2020-12-27 16:47:58',	'103.118.34.29',	'2020-12-27 16:47:58',	'103.118.34.29'),
(495,	40,	'Music is for every single person that walks the planet.',	'#F263CF',	'2020-12-27 16:51:43',	'103.118.34.29',	'2020-12-27 16:51:43',	'103.118.34.29'),
(496,	41,	'If you enter this world knowing you are loved and you leave this world knowing the same, then everything that happens in between can be dealt with.',	'#1E8896',	'2020-12-27 17:08:41',	'103.118.34.29',	'2020-12-27 17:08:41',	'103.118.34.29'),
(497,	41,	'To the world you may be one person but to one person you may be the world.',	'#CDEDF6',	'2020-12-27 17:08:56',	'103.118.34.29',	'2020-12-27 17:08:56',	'103.118.34.29'),
(498,	41,	'It’s better to fail in originality than to succeed in imitation.',	'#CA7747',	'2020-12-27 17:09:12',	'103.118.34.29',	'2020-12-27 17:09:12',	'103.118.34.29'),
(499,	41,	'I don’t care if the whole world is against you or teasing you or saying you’re not gonna make it. Believe in yourself, no matter what. ',	'#2FA220',	'2020-12-27 17:10:02',	'103.118.34.29',	'2020-12-27 17:10:02',	'103.118.34.29'),
(500,	41,	'The greatest education in the world is watching the masters at work.',	'#081c15',	'2020-12-27 17:10:21',	'103.118.34.29',	'2020-12-27 17:10:21',	'103.118.34.29'),
(501,	41,	'Sometimes when you’re treated unfairly it makes you stronger and more determined. I admire that kind of strength. People who have it take a stand and put their blood and soul into what they believe.',	'#603043',	'2020-12-27 17:17:39',	'103.118.34.29',	'2020-12-27 17:17:39',	'103.118.34.29'),
(502,	41,	'Work like there’s no tomorrow. Train. Strive. Really train and cultivate your talent to the highest degree.',	'#D84727',	'2020-12-27 17:17:56',	'103.118.34.29',	'2020-12-27 17:17:56',	'103.118.34.29'),
(503,	41,	'Please go for your dreams. Whatever your ideals, you can become whatever you want to become.',	'#F8A1AE',	'2020-12-27 17:18:09',	'103.118.34.29',	'2020-12-27 17:18:09',	'103.118.34.29'),
(504,	41,	'I’m interested in making a path instead of following a trail.',	'#005695',	'2020-12-27 17:18:30',	'103.118.34.29',	'2020-12-27 17:18:30',	'103.118.34.29'),
(505,	41,	'I’m going to search for my star until I find it. It’s hidden in the drawer in a scarf of wonder.',	'#B57EDC',	'2020-12-27 17:18:50',	'103.118.34.29',	'2020-12-27 17:18:50',	'103.118.34.29'),
(506,	41,	'I will never stop helping and loving people.',	'#197687',	'2020-12-27 17:19:06',	'103.118.34.29',	'2020-12-27 17:19:06',	'103.118.34.29'),
(507,	41,	'We have to heal our wounded world. The chaos, despair, and senseless destruction we see today are a result of the alienation that people feel from each other and their environment.',	'#F4879F',	'2020-12-27 17:19:18',	'103.118.34.29',	'2020-12-27 17:19:18',	'103.118.34.29'),
(508,	41,	'Forever continue to love, heal and educate the children, the future shines on them.',	'#D1D5F2',	'2020-12-27 17:19:37',	'103.118.34.29',	'2020-12-27 17:19:37',	'103.118.34.29'),
(509,	41,	'Sometimes I really want to ask, what happened to the truth? Is it out of fashion.',	'#E74D91',	'2020-12-27 17:19:51',	'103.118.34.29',	'2020-12-27 17:19:51',	'103.118.34.29'),
(510,	41,	'We can fly, you know. We just don’t know how to think the right thoughts and levitate ourselves off the ground.',	'#877B76',	'2020-12-27 17:20:09',	'103.118.34.29',	'2020-12-27 17:20:09',	'103.118.34.29'),
(511,	42,	'Money may not buy happiness, but it can damn well give it!',	'#0E203D',	'2020-12-27 17:23:05',	'103.118.34.29',	'2020-12-27 17:23:05',	'103.118.34.29'),
(512,	42,	'I always knew I was a star. And now, the rest of the world seems to agree with me.',	'#B0A49B',	'2020-12-27 17:23:25',	'103.118.34.29',	'2020-12-27 17:23:25',	'103.118.34.29'),
(513,	42,	'I like to be surrounded by splendid things.',	'#9889F6',	'2020-12-27 17:23:38',	'103.118.34.29',	'2020-12-27 17:23:38',	'103.118.34.29'),
(514,	42,	'I don’t talk to everybody, so they don’t really know the real me. I don’t think anybody will.',	'#00b4d8',	'2020-12-27 17:23:54',	'103.118.34.29',	'2020-12-27 17:24:11',	'103.118.34.29'),
(515,	42,	'The most important thing is to live a fabulous life. As long as it’s fabulous I don’t care how long it is.',	'#CDA9A0',	'2020-12-27 17:24:26',	'103.118.34.29',	'2020-12-27 17:24:26',	'103.118.34.29'),
(516,	42,	'You either have the magic or you don’t. There’s no way you can work up to it.',	'#F1A7FE',	'2020-12-27 17:26:57',	'103.118.34.29',	'2020-12-27 17:26:57',	'103.118.34.29'),
(517,	42,	'If I die tomorrow I will not regret. I really did everything I could.',	'#FFCA0A',	'2020-12-27 17:29:56',	'103.118.34.29',	'2020-12-27 17:29:56',	'103.118.34.29'),
(518,	42,	'Excess is part of my nature. Dullness is a disease. I really need danger and excitement. I’m never scared of putting myself out on a limb.',	'#1E457C',	'2020-12-27 17:31:48',	'103.118.34.29',	'2020-12-27 17:31:48',	'103.118.34.29'),
(519,	42,	'Who wants to live forever?',	'#F8A1AE',	'2020-12-27 17:32:03',	'103.118.34.29',	'2020-12-27 17:32:03',	'103.118.34.29'),
(520,	42,	'Oh, I was not made for heaven. No, I don’t want to go to heaven. Hell is much better. Think of all the interesting people you’re going to meet down there.',	'#f5cb5c',	'2020-12-27 17:32:16',	'103.118.34.29',	'2020-12-27 17:32:16',	'103.118.34.29'),
(521,	42,	'We don’t do it for the money … we do it for the music.',	'#EDDB36',	'2020-12-27 17:32:29',	'103.118.34.29',	'2020-12-27 17:32:29',	'103.118.34.29'),
(522,	42,	'I’m a very emotional person, a person of real extremes, and that’s often destructive both to myself and others.',	'#F4BBFF',	'2020-12-27 17:32:41',	'103.118.34.29',	'2020-12-27 17:32:41',	'103.118.34.29'),
(523,	42,	'In terms of love, you’re not in control and I hate that feeling. I seem to write a lot of sad songs because I’m a very tragic person. But there’s always an element of humour at the end.',	'#E5D6BE',	'2020-12-27 17:32:55',	'103.118.34.29',	'2020-12-27 17:32:55',	'103.118.34.29'),
(524,	42,	'When I’m dead, I want to be remembered as a musician of some worth and substance.',	'#C74D0C',	'2020-12-27 17:33:07',	'103.118.34.29',	'2020-12-27 17:33:07',	'103.118.34.29'),
(525,	43,	'Do something worth remembering.',	'#E32475',	'2020-12-27 17:40:57',	'103.118.34.29',	'2020-12-27 17:40:57',	'103.118.34.29'),
(526,	43,	'If you cry when you’re in love, it sure ain’t no disgrace.',	'#02c39a',	'2020-12-27 17:41:09',	'103.118.34.29',	'2020-12-27 17:41:09',	'103.118.34.29'),
(527,	43,	'The child needs a helping hand or he’ll grow up to be an angry young man some day.',	'#5EB1BF',	'2020-12-27 17:41:24',	'103.118.34.29',	'2020-12-27 17:41:24',	'103.118.34.29'),
(528,	43,	'Now and then, there’s a fool such as I.',	'#72efdd',	'2020-12-27 17:41:37',	'103.118.34.29',	'2020-12-27 17:41:37',	'103.118.34.29'),
(529,	43,	'The Lord can give, and the Lord can take away. I might be herding sheep next year.',	'#734F96',	'2020-12-27 17:41:51',	'103.118.34.29',	'2020-12-27 17:41:51',	'103.118.34.29'),
(530,	43,	'Never wait for tomorrow, what if tomorrow never comes?',	'#734F96',	'2020-12-27 17:42:10',	'103.118.34.29',	'2020-12-27 17:42:10',	'103.118.34.29'),
(531,	43,	'Take my hand, take my whole life too, but I can’t help falling in love with you.',	'#bc4749',	'2020-12-27 17:42:32',	'103.118.34.29',	'2020-12-27 17:42:32',	'103.118.34.29'),
(532,	43,	'When things go wrong, don’t go with them.',	'#0E203D',	'2020-12-27 17:45:04',	'103.118.34.29',	'2020-12-27 17:45:04',	'103.118.34.29'),
(533,	43,	'If you let your head get too big, it’ll break your neck.',	'#80ABE9',	'2020-12-27 17:52:47',	'103.118.34.29',	'2020-12-27 17:52:47',	'103.118.34.29'),
(534,	43,	'Animals don’t hate and we’re supposed to be better than them.',	'#4047F9',	'2020-12-27 17:53:04',	'103.118.34.29',	'2020-12-27 17:53:04',	'103.118.34.29'),
(535,	43,	'Trust is like the sun, you can shut it out for a time but it ain’t going away.',	'#5EB1BF',	'2020-12-27 17:53:36',	'103.118.34.29',	'2020-12-27 17:53:36',	'103.118.34.29'),
(536,	43,	'We can’t build our dreams on suspicious minds.',	'#F1BEBA',	'2020-12-27 17:56:13',	'103.118.34.29',	'2020-12-27 17:56:13',	'103.118.34.29'),
(537,	43,	'It’s human nature to gripe, but I’m going ahead and doing the best I can.',	'#F263CF',	'2020-12-27 17:56:27',	'103.118.34.29',	'2020-12-27 17:56:27',	'103.118.34.29'),
(538,	43,	'Whatever I will become will be what God has chosen for me.',	'#1E8896',	'2020-12-27 17:56:42',	'103.118.34.29',	'2020-12-27 17:56:42',	'103.118.34.29');
